INSERT INTO `prodi_texting` VALUES (1, 5, 1, NULL, 'vision', NULL, '<div style=\"text-align: justify;\">To expand as Integrated Program which capable of develop and educate student on knowledges, skills and abilities of managing hotel business and fully committed to generate optimal value on graduates who have the soul and spirit of entrepreneurship, Indonesian culture and International quality&nbsp;</div>', NULL, '2019-10-31 21:12:50', '3115006');
INSERT INTO `prodi_texting` VALUES (2, 5, 2, NULL, 'vision', NULL, '<div style=\"text-align: justify;\">Terus bertumbuh menjadi Program Studi terpadu dalam mempersiapkan dan mendekatkan mahasiswa dengan pengetahuan, keterampilan dan kemampuan mengelola bisnis perhotelan dan berkomitmen penuh untuk menghasilkan nilai optimal pada lulusan yang memiliki jiwa entrepreneurship, berbudaya Indonesia dan berkualitas Internasional.</div>', NULL, '2019-10-31 21:13:01', '3115006');
INSERT INTO `prodi_texting` VALUES (3, 5, 2, NULL, 'mission', NULL, '<ol><li style=\"text-align: justify; line-height: 1.5;\">Menghasilkan Sarjana Terapan dalam bidang hospitaliti dengan orientasi pada kebutuhan dunia usaha, bisnis dan masyarakat,</li><li style=\"text-align: justify; line-height: 1.5;\">Mengoptimalkan kegiatan belajar mengajar untuk menghasilkan lulusan dengan jiwa <i>entrepreneurship,</i></li><li style=\"text-align: justify; line-height: 1.5;\">Menjadi Program Studi yang mampu memberikan nilai lebih kepada mahasiswa, para dosen dan masyarakat,</li><li style=\"text-align: justify; line-height: 1.5;\">Berperan aktif untuk mendukung program pemerintah dalam pengembangan ilmu pengetahuan dan teknologi, serta ilmu terapan untuk kepentingan masyarakat dalam meningkatkan kualitas sumber daya manusia.</li></ol>', NULL, '2019-10-31 21:13:36', '3115006');
INSERT INTO `prodi_texting` VALUES (4, 5, 1, NULL, 'mission', NULL, '<ol><li style=\"text-align: justify; line-height: 1.5;\">Develop the graduates of Applied Bachelor\'s degree (Professional Bachelor) in the field of the Hotel Business with the orientation on the needs of the industry, business and society,</li><li style=\"text-align: justify; line-height: 1.5;\">Optimizing the teaching and learning activities to educate graduates with the soul of entrepreneurship,</li><li style=\"text-align: justify; line-height: 1.5;\">Become a course which capable of delivering added value to students, faculty and the community,</li><li style=\"text-align: justify; line-height: 1.5;\">Play an active role to support the Government in developing science and technology as well as the application of science for the benefit of the community in improving the quality of human resources.</li></ol>', NULL, '2019-10-31 21:25:16', '3115006');
INSERT INTO `prodi_texting` VALUES (5, 5, 1, NULL, 'whychoose', NULL, '<p style=\"text-align: justify; line-height: 1.5;\">The Hotel Business Program at Podomoro University not only offers formal education, but an unforgettable life experience, our closeness to industry gives our students the opportunity to explore all possibilities and build their networks while they study at &nbsp;Hotel Business Program.</p><p style=\"text-align: justify; line-height: 1.5;\">The curriculum is designed in such a way that students can obtain the knowledge needed to become a hotelier with an entrepreneurial spirit, including integrated internship program in the curriculum which enriches student experience and sharpens not only skills but also adds insight internationally.<br></p><p style=\"text-align: justify; line-height: 1.5;\">Another thing is the fun learning environment through simulation classes, enrichment activities, international-scale guest lecturers, and participation in various events that make the learning experience &nbsp;in Podomoro University more enjoyable.<br></p><p style=\"text-align: justify; line-height: 1.5;\">State of the art facilities are provided for students, so students are more ready to enter the industry with a five star scale and luxurious.</p><p style=\"text-align: justify; line-height: 1.5;\">Learning in Hotel Business Program is truly one of a kind experience!</p>', NULL, '2019-11-07 09:51:25', '3115006');
INSERT INTO `prodi_texting` VALUES (6, 5, 1, NULL, 'about', NULL, '<p style=\"text-align: justify; line-height: 1.5;\">Hotel Business Program in Podomoro University is a unique four years program that offers a wide range of knowledge, skills and networks to the industry. Since the very beginning of the study program, students will be trained to have an entrepreneurial mindset that includes critical thinking, independency, and problem-solving attitude as well as effective communication skill.</p><p style=\"text-align: justify; line-height: 1.5;\">During the study, students are required to accomplish two internship programs. The first one aims for the students to experience the operational side of the industry, while the second one is to experience the management side of the industry. This program allows the students to gain not only knowledge but also skill and attitude required by the industry in both national or international scope.</p>', NULL, '2019-10-31 21:45:39', '3115006');
INSERT INTO `prodi_texting` VALUES (7, 5, 2, NULL, 'graduate', NULL, '<p>Lulusan dari Program Studi Bisnis Perhotelan adalah para calon pemimpin masa depan di industri hospitaliti pada beberapa bidang, seperti hotel dan bidang jasa lainnya dengan kompetensi di beberapa divisi di bawah ini:</p><p>1. Kantor Depan</p><p>2. Kuliner</p><p>3. Menejemen Makanan dan Minuman</p><p>4. Manajemen Pelayanan</p><p>5. Personalia</p><p>6. <i>Revenue Management, </i>Penjualan dan Pemasaran</p><p>7. Komunikasi dan <i>Event.</i></p><p><br></p><p><br></p>', NULL, '2020-05-11 21:50:26', '3118048');
INSERT INTO `prodi_texting` VALUES (8, 5, 1, NULL, 'career', NULL, '<p>1. Tourismpreneur : Entrepreneur in Tourism Field</p><p>2. Entrepreneur : Having their own business</p><p>2. Hotelier : Work in international 5-Star Hotels in various division</p><ul><li>&nbsp; &nbsp; Room Division</li><li>&nbsp; &nbsp; Sales and Marketing</li><li>&nbsp; &nbsp; Human Resources</li><li>&nbsp; &nbsp; Banquet</li><li>&nbsp; &nbsp; Kitchen : Food Production, Pastry, and Bakery<br></li></ul><p>3. Lecturer</p><p>4. Consultant</p><p>5. Food Bloggers</p><p>6. Food Stylist</p><p><br></p>', NULL, '2020-05-11 22:06:29', '3118048');
INSERT INTO `prodi_texting` VALUES (9, 5, 2, NULL, 'career', NULL, '<p>1. Tourismpreneur : Wirausahawan di bidang pariwisata</p><p>2. Wirausahawan</p><p>2. Hotelier : Bekerja di hotel berbintang 5 yang berskala intersnasional di beberapa bidang diantaranya:</p><ul><li>&nbsp; &nbsp; Divisi Kamar</li><li>&nbsp; &nbsp; Penjualan dan Pemasaran</li><li>&nbsp; &nbsp; Personalia</li><li>&nbsp; &nbsp; <i>Banquet</i></li><li>&nbsp; &nbsp; Dapur : <i>Food Production, Pastry, and Bakery</i><br></li></ul><p>3. Doseen</p><p>4. Konsultan</p><p>5. <i>Food Blogger</i></p><p>6. <i>Food Stylist</i></p>', NULL, '2020-05-11 22:08:36', '3118048');
INSERT INTO `prodi_texting` VALUES (10, 5, 3, NULL, 'vision', NULL, '<span style=\"text-align: justify;\">Le développement continu du programme d’études intégrées vise à former&nbsp; les étudiants à la gestion des affaires hôtelières, de développer leurs compétences de s’y engager&nbsp; pleinement en recherchant un résultat optimal alliant l’esprit d’entreprise, les atouts de la culture indonésienne et&nbsp;</span><span lang=\"IN\" style=\"text-align: justify;\">de&nbsp;</span><span style=\"text-align: justify;\">la qualité internationale.&nbsp;</span><br>', NULL, '2019-11-08 09:08:05', '3115006');
INSERT INTO `prodi_texting` VALUES (11, 5, 3, NULL, 'mission', NULL, '<ol><li style=\"text-align: justify; margin: 0cm 0cm 0.0001pt;\">Produire des diplômés d’études supérieures appliquées dans le domaine d’accueil correspondant aux exigences du monde des affaires, du commerce et de la société en général.<o:p></o:p></li><li style=\"text-align: justify; margin: 0cm 0cm 0.0001pt;\">Optimiser l’activité d’apprentissage et d’enseignement afin de concevoir&nbsp; les diplômés aux impératifs de qualité d’entrepreneur.<o:p></o:p></li><li style=\"text-align: justify; margin: 0cm 0cm 0.0001pt;\">Créer un programme d’étude permettant d’apporter une valeur ajoutée aux étudiants comme pour les enseignants et à la société en général.<o:p></o:p></li><li style=\"text-align: justify; margin: 0cm 0cm 0.0001pt;\">Soutenir activement le programme du gouvernement dans le développement de la science et technologie, ainsi que la science appliquée dans l’intérêt de la société et&nbsp;<span lang=\"IN\">notamment&nbsp;</span>l’amélioration de la qualité des ressources humaines.<font color=\"#222222\" face=\"Times New Roman, serif\" size=\"3\"><o:p></o:p></font></li></ol>', NULL, '2019-11-08 09:13:35', '3115006');
INSERT INTO `prodi_texting` VALUES (12, 6, 1, NULL, 'welcoming', NULL, '<p class=\"MsoNormal\" style=\"line-height: 1.4;\"><span lang=\"EN-CA\" style=\"line-height: 115%;\">I would like to\nwelcome you to Business Law Study Program Podomoro University (BLP). In this\nprogram study, my goals have been to increase knowledge and skills in ways that\nare independent, creative, comprehensive, and advance that enhance learning. It\nis my intention to expand your scope of knowledge and skills in jurisprudence\nby concentrating and emphasizing on business law in greater detail.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"line-height: 1.4;\"><span lang=\"EN-CA\" style=\"line-height: 115%;\">Although business law\nis not easy, once you become legal scholars-especially skillful ones on\nbusiness law aspects-your rewards will be great. This skill and knowledge\ndetermines your carier and your future. Furthermore, you will be enjoying for\nhaving this knowledge and ability as well as skill in business law as I do in\nhaving greater opportunities for career mobility, with a broad range\npossibilities worldwide.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"line-height: 1.4;\"><span lang=\"EN-CA\" style=\"line-height: 115%;\">Moreover, business\nlaw itself is a broad field. Nearly every recognised universities and law\nschool included business related subjects into their curriculum. The goal is simple,\nto convert students to become eligible legal scholars for the future. Here at BLP,\nwe have successfully attempted to treat in particular detail the subjects that\nactually engage in more advanced and more suitable to our students in expanding\ntheir scope of knowledge by emphasizing business law. This is why BLP students\nfrom time to time have been participating dilligently and actively engage in\ntheir academic activities throughout the years supported by the university and\nBLP team. I am indebted to them. They are splendid lecturers, staffs, and students\nand I am delighted to be able to showcase their values, integrity and\ndedication here at BLP through BLP’s leading-edge program, a genuine\nthank-you.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"line-height: 1.4;\"><span lang=\"EN-CA\" style=\"line-height: 115%;\">Finally, please read\nthouroughly the rest of the information in this website and receive BLP guide,\nand take the next step toward a rewarding career in business law. <o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"line-height: 1.4;\"><span lang=\"EN-CA\" style=\"line-height: 115%;\">Again, welcome and\nhave a wonderful and memorable academic years with us.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"line-height: 1.4;\">Sincerely,</p>\n\n<p class=\"MsoNormal\" style=\"line-height: 1.4;\"><span lang=\"EN-CA\" style=\"line-height: 115%;\">Fajar Sugianto<font face=\"Book Antiqua, serif\"><span style=\"font-size: 12pt;\"><o:p></o:p></span></font></span></p>', NULL, '2020-02-13 16:57:19', '3019024');
INSERT INTO `prodi_texting` VALUES (13, 6, 1, NULL, 'about', NULL, '<p class=\"MsoNormal\" style=\"text-align: center; \"><span lang=\"EN-CA\" style=\"line-height: 115%;\"><b>BUSINESS LAW STUDENTS ACQUIRE SKILLS, NOT JUST\nKNOWLEDGE</b><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\">\n\n</p><p class=\"MsoNormal\" style=\"\">&nbsp;&nbsp;&nbsp;&nbsp;<span lang=\"EN-CA\" style=\"line-height: 115%;\">For many, a law degree is the first step along the\npath to a career in the legal sector. However, this is certainly not the only\nreason to study law at Podomoro University. Business Law Study Program at\nPodomoro University offers a range of business law courses to fit your careers\nambitions by enhancing academic standards as well as providing the opportunity\nto develop a range of skills and explore many aspects of human life. It gives\nyou the chance to sharpen your mind, strengthen your understanding and deepen\nyour experience across the full range of humanities and social sciences.</span></p><p class=\"MsoNormal\" style=\"\">&nbsp;&nbsp;&nbsp;&nbsp;<span lang=\"EN-CA\" style=\"line-height: 115%;\">Our program can give you a strategic advance in\npursuing graduate education in both jurisprudence and business law because:</span></p><ul><li style=\"\"><span style=\"text-indent: -18pt;\">Outstanding\nlessons from experienced practitioners and scholars who work in the heart of\ncorporate and business law.</span></li><li style=\"\"><span style=\"text-indent: -18pt;\">Training\nin real-world skills essential for success in today’s corporate and business\njob markets.</span></li><li style=\"\">An\naccessible learning methods that work with your academic activities.</li></ul><p class=\"MsoNormal\" style=\"\">&nbsp;&nbsp;&nbsp;&nbsp;<span lang=\"EN-CA\" style=\"line-height: 115%;\">Program business law’s principal course is challenging\nand widely recognized. The challenges in this degree prepare you to take 144\ncredits in 3.5 years: <o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"\"><span lang=\"EN-CA\" style=\"line-height: 115%;\"><b>1st Year</b><o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"\"><span lang=\"EN-CA\" style=\"line-height: 115%;\">Predetermined Courses and Essential Foundation\nfor Subsequent Legal Study<o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"\"><span lang=\"EN-CA\" style=\"line-height: 115%;\"><b>2nd Year</b><o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"\"><span lang=\"EN-CA\" style=\"line-height: 115%;\">Core Courses to Broaden the Foundation Laid in the First\nYear<o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"\"><span lang=\"EN-CA\" style=\"line-height: 115%;\"><b>3rd Year</b><o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"\"><span lang=\"EN-CA\" style=\"line-height: 115%;\">Skills and Perspective Courses<o:p></o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"\"><span lang=\"EN-CA\" style=\"line-height: 115%;\"><b>4th Year</b><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span lang=\"EN-CA\" style=\"line-height: 115%;\"><o:p>\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n</o:p></span></p><p class=\"MsoNormal\" align=\"center\" style=\"\"><span lang=\"EN-CA\" style=\"line-height: 115%;\">Concentration, Internship and Thesis<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"\"><span lang=\"EN-CA\" style=\"line-height: 115%;\"><o:p><br></o:p></span></p><p class=\"MsoNormal\" style=\"\"><span lang=\"EN-CA\" style=\"font-size:12.0pt;line-height:115%;font-family:&quot;Book Antiqua&quot;,serif;\nmso-ansi-language:EN-CA\"><o:p><br></o:p></span></p>', NULL, '2020-02-13 16:53:36', '3019024');
INSERT INTO `prodi_texting` VALUES (14, 6, 1, NULL, 'excellence', NULL, '<p style=\"text-align: center; \"><span lang=\"EN-CA\" style=\"line-height: 115%;\"><b>Get\na wealth of industry and organisational experience before you graduate</b></span></p>\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"\"><span lang=\"EN-CA\" style=\"line-height: 115%;\">When you study business\nlaw at Podomoro University, you will experience the fast-paced world of\nbusiness and build a strong industry network long before you graduate. With\nsupport from recognised organisations and industries, you will be able to work\nalongside leaders on projects and assignments that are relevant to your area of\nstudy.</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: center; \"><span lang=\"EN-CA\" style=\"text-indent: -18pt; line-height: 115%;\"><b>Connect\nwith industry</b></span></p>\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"\"><span lang=\"EN-CA\" style=\"line-height: 115%;\">Our team helps link\nBLP students with the business world, and will help you expand your network\nthrough internships, networking events, training sessions and guest lectures.</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: center; \"><span lang=\"EN-CA\" style=\"text-indent: -18pt; line-height: 115%;\"><b>Internships</b></span></p>\n\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"\"><span lang=\"EN-CA\" style=\"line-height: 115%;\">Through our\npartnership with professionals, you could be selected to undertake an internship\nwhere you will work on a real-world cases related to business law area of\nstudy.</span></p><p class=\"MsoListParagraphCxSpMiddle\" style=\"text-align: center; \"><span lang=\"EN-CA\" style=\"text-indent: -18pt; line-height: 115%;\"><b>Skills\nImprovement</b></span></p>\n\n<p class=\"MsoListParagraphCxSpLast\" style=\"\"><span lang=\"EN-CA\" style=\"line-height: 115%;\">Our program helps you learn, develop, improve as well\nas sharpen your comparative and competitive skills for the commercial business\nenvironment.<font face=\"Book Antiqua, serif\"><span style=\"font-size: 12pt;\"><o:p></o:p></span></font></span></p>', NULL, '2020-02-13 16:54:43', '3019024');
INSERT INTO `prodi_texting` VALUES (15, 6, 1, NULL, 'whychoose', NULL, '<p class=\"MsoNormal\" style=\"\">&nbsp;&nbsp;&nbsp;&nbsp;<span lang=\"EN-CA\" style=\"line-height: 115%;\">All business activities regulated by the law, this\nmakes business law comprises governance of commercial and business transactions\nin both the public and private realms. Most recently, the most perplexing legal\nproblems of the present time are concerned with business, and a clear\nconception of how the doing of business differs, if at all, from the other\nactivities of life, as well as of its legal characteristics becomes very\nimportant. The laws applicable to business properly from a distinct branch of\njurisprudence, and are so recognized in practically all countries.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"\">&nbsp;&nbsp;&nbsp;&nbsp;<span lang=\"EN-CA\" style=\"line-height: 115%;\">In the nature of things, there is a difference\n(naturally and legally) between business on the one hand and the other activities\nand interest of life on the other, therefore different rules are applicable to\nbusiness than to the more formal, fixed, and personal relations of society. As\nbusiness becomes increasingly globalized, business entities must ensure that\nthey both understand and met legal requirements ensuring that all business\npractices are legitimate. <o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<span lang=\"EN-CA\" style=\"line-height: 115%;\">All business, large and small must comply the legal\nregulations. In many cases, this involves the expertise of a specialist who\nengages in business flexibility to administer the business activities within\nlegal guidelines. It requires a good understanding to provide an in-depth\nanalysis of the legal aspects of running a business. In a broader sense, it is\nimportant for everybody to understand how business law impacts commerce both\ndomestically and abroad.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\" style=\"\">&nbsp;&nbsp;&nbsp;&nbsp;<span lang=\"EN-CA\" style=\"line-height: 115%;\">Since BLP focuses on acquiring skills, not just\nknowledge-that is to have a good understanding of the legal aspects of running\nand protecting business-our curriculum is designed to cover the largest legal\nareas necessary in business, including legal basics, contract law, intellectual\nproperty, corporate law, tax law, competition and consumer protection,\nentertainment law, banking law, employment law, environmental law, property and\nconstruction law, disputes resolution, as well as law and economics (economic\nanalysis of law).<font face=\"Book Antiqua, serif\"><span style=\"font-size: 12pt;\"><o:p></o:p></span></font></span></p>', NULL, '2020-02-13 16:52:50', '3019024');
