kini dan mendatang di tingkat nasional maupun internasional.</li><li style=\"\">Melakukan kegiatan\npendidikan multi disiplin, penelitian kreatif dan pengabdian masyarakat untuk\nmeningkatkan nilai kehidupan secara berkelanjutan melalui pemberdayaan dosen\ndan mahasiswa.</li><li style=\"\">Menerapkan suasana\nbelajar mengajar yang kondusif untuk mendorong terciptanya sivitas akademika\nyang memiliki standar profesionalisme tinggi; komitmen pada kualitas; perilaku\netis serta keinginan belajar sepanjang hayat.</li></ol><p style=\"text-align: justify;\"><o:p></o:p></p>\n\n<!--EndFragment-->', NULL, '2020-02-20 15:17:34', '2218002');
