ernationally by\ncarrying out innovative and entrepreneurial values<o:p></o:p></p>\n\n<!--EndFragment-->', NULL, '2020-02-20 15:17:03', '2218002');
INSERT INTO `prodi_texting` VALUES (19, 5, 1, NULL, 'welcoming', NULL, '<p class=\"MsoNormal\" style=\"text-align: justify; \"><span lang=\"EN-US\">Welcome to Hotel Business Program!</span></p><p class=\"MsoNormal\" style=\"text-align: justify; \">At Hotel Business Program, we are committed to providing the best for our students. The learning process is designed to prepare students to face industry challenges. Students will be exposed to a unique learning experience where knowledge and skills, as well as opportunities to be introduced to the industry, are given to the students during their study program&nbsp;</p><p class=\"MsoNormal\" style=\"text-align: justify; \">Our closeness to the industry also gives benefits to the students where it enables them to develop their networks starting from very early stage. Other than that, a series of other benefits, ranging from the internship program, guest lecturers, major events experiences also available for the students.</p><p class=\"MsoNormal\" style=\"text-align: justify; \">The lecturers who have a comprehensive background in their respective fields and with one of a kind learning methods which we called \"entrepreneurial learning\" make the learning atmosphere more enjoyable and have an impact on the development of student character.</p><p class=\"MsoNormal\" style=\"text-align: justify; \">We are really excited to welcome you here in Hotel Business Program, welcome home!</p>', NULL, '2019-11-28 14:30:55', '3118048');
INSERT INTO `prodi_texting` VALUES (20, 5, 2, NULL, 'welcoming', NULL, '<p class=\"MsoNormal\" style=\"text-align: justify; \"><span lang=\"EN-US\">Selamat Datang di Program Studi Bisnis Perhotelan!<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"text-align: justify; \">Di&nbsp;Program Studi Bisnis Perhotelan&nbsp; kami berkomitmen untuk memberikan yang terbaik bagi mahasiswa kami. Proses pembelajaran dirancang untuk mempersiapkan para mahasiswa menghadapi tantangan yang ada di industri. Mahasiswa akan dihadapkan pada pengalaman belajar yang unik di mana pengetahuan dan keterampilan, serta peluang untuk diperkenalkan ke industri diberikan kepada mahasiswa selama mereka belajar di Program Studi Bisnis Perhotelan.</p><p class=\"MsoNormal\" style=\"text-align: justify; \">Kedekatan kami dengan industri juga memberikan manfaat bagi seluruh mahasiswa di mana memungkinkan mereka untuk mengembangkan&nbsp;<i>network&nbsp;</i> mereka mulai sedini mungkin. Selain itu, serangkaian keunggulan lainnya, mulai dari program magang, dosen tamu, pengalaman untuk hadir dan menjadi bagian dari <i>event </i>besar juga tersedia untuk para mahasiswa.</p><p class=\"MsoNormal\" style=\"text-align: justify; \">Para dosen yang memiliki latar belakang yang komprehensif di bidangnya masing-masing dan dengan salah satu metode pembelajaran yang kami sebut \"<i>entrepreneurial learning</i>\" membuat suasana belajar lebih menyenangkan dan berdampak pada pengembangan karakter mahasiswa.</p><p class=\"MsoNormal\">Kami sangat senang untuk menyambut Anda di Program Studi Bisnis Perhotelan, <i>welcome home!</i><br></p>', NULL, '2019-11-28 14:31:05', '3118048');
INSERT INTO `prodi_texting` VALUES (21, 9, 1, NULL, 'vision', NULL, 'A leading study program in National and International scale with innovative and entrepreneurial values in urban and regional planning, specifically in real estate and property', NULL, '2019-11-22 10:12:56', '2516037');
INSERT INTO `prodi_texting` VALUES (22, 9, 1, NULL, 'mission', NULL, '<ol><li>Administering educational activities in urban and regional planning based on the excellence of science and technology in real estate and property planning</li><li>Conducting high quality of educational activities in urban and regional planning to develop excellence graduate who responsive to global challenge</li><li>Applying good teaching and learning activities to encourage professional, competitive, and ethical academic community</li><li>Conducting implementative education, research and community service</li></ol>', NULL, '2019-11-22 10:18:30', '2516037');
INSERT INTO `prodi_texting` VALUES (23, 9, 1, NULL, 'welcoming', NULL, '<p style=\"text-align: justify; line-height: 1.5;\"><span style=\"font-size: 18px;\">Hi New Generation!</span></p><p style=\"text-align: justify; line-height: 1.5;\"><span style=\"font-size: 18px;\">Cities are places where we stay and live. Everyone hopes their lives can go well for the sake of beautiful future. Adequate city services encouraging the nation\'s to be intelligent as well as sensitive to the environment and surrounding. Supports in creating a smart and sustainable city, Universitas Agung Podomoro establish the Urban and Regional Planning Study Program with scientific specialization in real estate and environmental planning. Through the OBE (Outcome Based Education) curriculum approach and even more with the presence of organic laboratory facilities (Agung Podomoro Land project), We have become an excellent study program in Urban and Regional Department.</span></p><p style=\"text-align: justify; line-height: 1.5;\"><span style=\"font-size: 18px;\">Responding to the challenges, we are committed to continually develop science and maintain the academic environment in order to achieve better urban and regional planning in the future!</span></p><p style=\"text-align: justify; line-height: 1.5;\"><span style=\"font-size: 18px;\">Warmest Regards,</span><br></p><p style=\"text-align: justify; line-height: 1.5;\"><!--StartFragment--><!--EndFragment--></p><p style=\"text-align: justify; line-height: 1.5;\"><span style=\"font-size: 18px;\">Nilam Atsirina Krisnaputri, S.T., M.T.</span></p><p style=\"text-align: justify; line-height: 1.5;\"><br></p>', NULL, '2019-12-03 15:39:59', '2516037');
