yle-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin-top:0in;\n	mso-para-margin-right:0in;\n	mso-para-margin-bottom:8.0pt;\n	mso-para-margin-left:0in;\n	line-height:107%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n<p class=\"MsoNormal\">Urban and Regional Planning is very intriguing, especially\nfrom the development perspectives of urban, suburban and rural areas. The Urban\nand Regional Planning Study Program learns how to identify and analyze existing\npotentials and problems to plan the best solution for the development and\nsustainability of a regional system. <o:p></o:p></p>\n\n<p class=\"MsoNormal\">Urban and Regional Planning Program of Universitas Agung Podomoro specializes in real estate planning and development, that is principled to\nconsider environmental sustainability. The curriculum is designed and developed\nby OBE (Outcome Based Education) approach. Through this framework, students are\nguided and provided learning activities by given an educational theory to\naccomplish the abilities that are suitable for the fulfilment of graduates’\nnecessity.<o:p></o:p></p>\n\n<!--EndFragment-->', NULL, '2019-11-28 14:17:02', '2516037');
