noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin-top:0in;\n	mso-para-margin-right:0in;\n	mso-para-margin-bottom:8.0pt;\n	mso-para-margin-left:0in;\n	line-height:107%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n<p class=\"MsoNormal\">Urban and Regional Planning in Universitas Agung Podomoro is\nundergraduate program (S1). <o:p></o:p></p>\n\n<p class=\"MsoNormal\">To achieve a better understanding on urban and regional\nissues, the focus of student learning in Podomoro Urban and Regional Study\nPrograms are:<o:p></o:p></p>\n\n\n\n\n\n\n\n\n\n<ul><li>Strong\nbasic understanding of knowledge, not only in urban and regional planning, but\nalso in real estate planning sectors.<o:p></o:p></li><li>Comprehensive\nabilities to integrate existing knowledge in identifying problems, planning\nformulas and problem solving. <o:p></o:p></li><li>Comprehensive\nabilities underlying planning decisions through concepts, models, and scenarios\non urban and regional issues. <o:p></o:p></li><li>Understanding\nthe process of urban and regional planning, as well as the property development\nwithin. <o:p></o:p></li><li>Understanding\nand taking concrete actions in urban and regional planning, as well as the\nproperty development within.&nbsp;&nbsp;<o:p></o:p></li></ul>\n\n<!--EndFragment-->', NULL, '2019-11-28 14:18:37', '2516037');
INSERT INTO `prodi_texting` VALUES (26, 9, 1, NULL, 'graduate', NULL, '<!--StartFragment--><div class=\"tlid-input input\"><div class=\"source-wrap\"><div class=\"input-full-height-wrapper tlid-input-full-height-wrapper\"><div class=\"source-input\"><div class=\"source-footer-wrap source-or-target-footer\"><div class=\"character-count tlid-character-count\"><div class=\"cc-ctr normal\">\"Professionals who are innovative, anticipatory and have integrity with the dynamics of regional and city development which are oriented towards sustainability\".<br></div></div></div></div></div></div></div><!--EndFragment-->', NULL, '2019-11-28 14:22:54', '2516037');
INSERT INTO `prodi_texting` VALUES (27, 9, 1, NULL, 'career', NULL, '<ul><li>Land Use Planner</li><li>Land Appraiser</li><li>Urban Designer</li><li>Property Planner</li><li>Business Development Expert (In Property)</li><li>GIS Expert</li></ul>', NULL, '2019-11-28 14:24:51', '2516037');
INSERT INTO `prodi_texting` VALUES (28, 5, 1, NULL, 'testimonials', NULL, 'Entering this university is my milestone. Where the perfect stepping stones to your future and the real world are served limitlessly in front of you. I was not only taught on how to be a real hotelier but also how to be an independent, humble, selfless change-makers. This is where you have the chance to build your future and brilliant characters that you want to blossom out within you. With all these is left one question that always pushes me: Are you willing to take all the chances to be your stepping stones or not. This is my story.', NULL, '2019-11-28 14:26:41', '3118048');
INSERT INTO `prodi_texting` VALUES (29, 9, 1, NULL, 'testimonials', NULL, '<!--StartFragment-->Being a Podomoro University Urban and Regional Planning student gave me a wealth of knowledge and experience about “the identity of a city”, using modern learning methods supported by qualified teaching staff increasingly made me understand the learning provided and I become sure of myself of the knowledge I got in here will be valuable for work in the future<!--EndFragment-->', NULL, '2019-11-28 14:32:35', '2516037');
INSERT INTO `prodi_texting` VALUES (30, 9, 1, NULL, 'testimonials', NULL, '<!--StartFragment-->Studying at Podomoro University is a pride for me. This campus has provided a wealth of experience and knowledge ranging from going directly to the field and in terms of the practice of designing cities. I believe that this campus will make me a graduate who is ready to work.<!--EndFragment--><!--EndFragment-->', NULL, '2019-11-28 14:33:15', '2516037');
