 managerial and business knowledge and skills to face\ncurrent and future challenges at national and international levels.</p><p style=\"line-height: 1.2;\">2.\nConducting multi-disciplinary educational activities, creative research and\ncommunity service to increase the value of life in a sustainable manner through\nempowering lecturers and students.</p><p style=\"line-height: 1.2;\"><o:p></o:p></p><p style=\"line-height: 1.2;\">3. Applying\nan atmosphere of teaching and learning conducive to encourage the creation of\nacademics who have high standards of professionalism; commitment to quality;\nethical behavior and lifelong learning desires.<o:p></o:p></p>\n\n<!--EndFragment-->', NULL, '2020-02-20 15:18:09', '2218002');
