tStyles>\n</xml><![endif]-->\n<style>\n<!--\n /* Font Definitions */\n @font-face\n	{font-family:\"Cambria Math\";\n	panose-1:2 4 5 3 5 4 6 3 2 4;\n	mso-font-charset:1;\n	mso-generic-font-family:roman;\n	mso-font-pitch:variable;\n	mso-font-signature:0 0 0 0 0 0;}\n@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-536858881 -1073732485 9 0 511 0;}\n /* Style Definitions */\n p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:\"\";\n	margin-top:0in;\n	margin-right:0in;\n	margin-bottom:8.0pt;\n	margin-left:0in;\n	line-height:107%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n.MsoChpDefault\n	{mso-style-type:export-only;\n	mso-default-props:yes;\n	font-family:\"Calibri\",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n.MsoPapDefault\n	{mso-style-type:export-only;\n	margin-bottom:8.0pt;\n	line-height:107%;}\n@page WordSection1\n	{size:8.5in 11.0in;\n	margin:1.0in 1.0in 1.0in 1.0in;\n	mso-header-margin:.5in;\n	mso-footer-margin:.5in;\n	mso-paper-source:0;}\ndiv.WordSection1\n	{page:WordSection1;}\n-->\n</style>\n<!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin-top:0in;\n	mso-para-margin-right:0in;\n	mso-para-margin-bottom:8.0pt;\n	mso-para-margin-left:0in;\n	line-height:107%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 1.5;\"><span style=\"font-size: 18px;\">Hi New Generation!</span><o:p></o:p></p><span style=\"font-size: 18px;\">\n\n</span><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 1.5;\"><span style=\"font-size: 18px;\">Kota merupakan tempat dimana kita menjalani hidup dan\ntinggal. Semua orang berharap agar kehidupan mereka dapat berjalan dengan baik\ndemi mencapai masa depan yang indah. Pelayanan kota yang lengkap dan nyaman\nmenjadikan generasi bangsa yang cerdas dan peka terhadap lingkungan sekitarnya.\nUniversitas Agung Podomoro turut mendukung dalam mewujudkan kota pintar dan\nberkelanjutan melalui pendirian Program Studi Perencanaan Wilayah dan Kota.\nMelalui pendekatan kurikulum berbasis OBE (Outcome Based Education) dengan\nspesialisasi keilmuan perencanaan real estate dan lingkungan serta laboratorium\norganik (Agung Podomoro Land project) yang dimiliki, kami menjadi program studi\nyang unggul dibidang perencanaan wilayah dan kota.</span><span style=\"font-size: 18px;\">&nbsp;</span></p><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 1.5;\"><o:p></o:p></p><span style=\"font-size: 18px;\">\n\n</span><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 1.5;\"><span style=\"font-size: 18px;\">Tentu kami berkomitmen dalam terus mengembangkan keilmuan\nserta menjaga lingkungan akademis untuk mencapai masa depan perencanaan wilayah\ndan kota yang mampu menjawab tantangan dan peluang dimasa depan!</span><o:p></o:p></p><span style=\"font-size: 18px;\">\n\n</span><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 1.5;\"><o:p><span style=\"font-size: 18px;\">&nbsp;</span></o:p></p><span style=\"font-size: 18px;\">\n\n</span><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 1.5;\"><span style=\"font-size: 18px;\">Salam hangat.</span><o:p></o:p></p><span style=\"font-size: 18px;\">\n\n</span><p class=\"MsoNormal\" style=\"text-align: justify; line-height: 1.5;\"><span style=\"font-size: 18px;\">Nilam Atsirina Krisnaputri, S.T., M.T.</span><o:p></o:p></p>\n\n<!--EndFragment-->', NULL, '2019-12-03 15:40:14', '2516037');
INSERT INTO `prodi_texting` VALUES (33, 1, 1, NULL, 'welcoming', NULL, '<p>\n<!--StartFragment-->Adli Nadia<br>\n	<br>\n	M.Arch., Design and Computation,&nbsp; Institut Teknologi Bandung; B.Arch., Universitas Diponegoro.<br>\n	<br>\n	Adli Nadia is a lecturer at Podomoro University Department of Architecture. He holds a master degree in Design and Computation from&nbsp;Institut Teknologi Bandung<!--EndFragment-->, Indonesia. His current research interests are related to experimental architecture, simulation, behavior, and computational design.</p><p>As practicing Lecturer, his design conception emphasizes spatial exploration, craftsmanship, and \nmeanings. He also has a broad experience in designing large scale commercial&nbsp; buildings to small scale private housings.<!--EndFragment-->\n\n</p><br>\n\n', NULL, '2020-01-30 15:22:34', '2114033');
INSERT INTO `prodi_texting` VALUES (34, 6, 2, NULL, 'vision', NULL, '<table width=\"964\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\n <tbody><tr>\n  <td width=\"698\" valign=\"top\">\n  <p><span lang=\"EN-US\">Menjadi pusat studi hukum bisnis terbaik di Indonesia</span></p></td></tr></tbody></table>\n\n\n\n\n\n', NULL, '2020-01-03 10:31:42', '3019024');
INSERT INTO `prodi_texting` VALUES (35, 6, 1, NULL, 'mission', NULL, '\n\n\n\n\n\n<ol><li>Organize education, research, and community service in the field of Business Law with a theory and practice approach</li><li>Produce graduates with a spirit of lawyerpreneur who are Indonesian-minded specifically, as well as ASEAN and international in general who master Business Law</li><li>Build the character of academics who are professional, competent, with integrity, and able to compete in facing global challenges in the field of Business Law</li><li>Fulfill the needs and expectations of the University by implementing learning quality standards that refer to international standards and mastery of science and technology.</li></ol><div class=\"elementor-row\"><div class=\"elementor-element elementor-element-55c7160 elementor-column elementor-col-100 elementor-top-column\" data-element_type=\"column\" data-id=\"55c7160\"><div class=\"elementor-column-wrap elementor-element-populated\"><div class=\"elementor-widget-wrap\"><section class=\"elementor-element elementor-element-4b195b0 elementor-section-content-middle elementor-section-boxed elementor-section-height-default elementor-section-height-default elementor-section elementor-inner-section\" data-element_type=\"section\" data-id=\"4b195b0\"><div class=\"elementor-container elementor-column-gap-no\"><div class=\"elementor-row\"><div class=\"elementor-element elementor-element-73fbe4d elementor-column elementor-col-50 elementor-inner-column\" data-element_type=\"column\" data-id=\"73fbe4d\"><div class=\"elementor-column-wrap elementor-element-populated\"><div class=\"elementor-widget-wrap\"><div class=\"elementor-element elementor-element-0338187 elementor-widget elementor-widget-image\" data-element_type=\"widget\" data-id=\"0338187\" data-widget_type=\"image.default\"><div class=\"elementor-widget-container\"><br class=\"Apple-interchange-newline\">\n\n</div></div></div></div></div></div></div></section></div></div></div></div><br>', NULL, '2020-01-03 10:33:03', '3019024');
INSERT INTO `prodi_texting` VALUES (36, 6, 2, NULL, 'graduate', NULL, '<p><span lang=\"EN-US\">Program studi hukum bisnis\nuniversitas agung podomoro menyajikan kurikulum berbasis kkni dengan menekankan\nkepada penerapan skill sehingga dapat memiliki lulusan yang profesional dalam\n:&nbsp;</span></p>\n\n<ul><li><span lang=\"EN-US\">melakukan penelitian di bidang hukum bisnis untuk kepentingan akademis\ndan praktis;</span></li><li><span lang=\"EN-US\">memberikan pendapat hukum (<i>legal opinion</i>) yang komprehensif;</span></li><li><span lang=\"EN-US\">membuat perjanjian bisnis dalam lingkup nasional maupun internasional; dan</span></li><li><span lang=\"EN-US\">mengerjakan uji tuntas (<i>legal due dilligence</i>) khususunya terkait\ndengan hukum bisnis, berfikir dan membentuk suatu bisnis.</span>\n\n\n\n</li></ul>', NULL, '2020-01-02 16:50:59', '3019024');
INSERT INTO `prodi_texting` VALUES (37, 6, 1, NULL, 'career', NULL, '<p><span lang=\"EN-US\"><span>1.<span>&nbsp;</span></span></span><span lang=\"EN-US\">Advokat</span></p>\n\n<p><span lang=\"EN-US\"><span>2.<span>&nbsp;</span></span></span><span lang=\"EN-US\">Konsultan Hukum</span></p>\n\n<p><span lang=\"EN-US\"><span>3.<span>&nbsp;</span></span></span><span lang=\"EN-US\">Penasihat Hukum Internal Perusahaan</span></p>\n\n<p><span lang=\"EN-US\"><span>4.<span>&nbsp;</span></span></span><span lang=\"EN-US\">Notaris</span></p>\n\n<p><span lang=\"EN-US\"><span>5.<span>&nbsp;</span></span></span><span lang=\"EN-US\">Notaris Pasar Modal</span></p>\n\n<p><span lang=\"EN-US\"><span>6.<span>&nbsp;K</span></span></span><span lang=\"EN-US\">onsultan Kekayaan Intelektual</span></p><p>7. <span lang=\"EN-US\">Pekerja di Sektor Publik (Eksekutif, Legislatif, dan Yudikatif)</span>\n\n\n\n</p>', NULL, '2020-02-13 16:55:33', '3019024');
INSERT INTO `prodi_texting` VALUES (38, 6, 1, NULL, 'vision', NULL, '<span>Become the center of the best Business Law Studies in Indonesia</span>\n\n', NULL, '2020-01-03 10:31:19', '3019024');
INSERT INTO `prodi_texting` VALUES (39, 6, 2, NULL, 'mission', NULL, '<ol><li><span lang=\"EN-US\">Menyelenggarakan pendidikan,\n  penelitian, dan pengabdian masyarakat di bidang hukum bisnis dengan\n  pendekatan teori dan praktik.</span></li><li><span lang=\"EN-US\">Menghasilkan lulusan berjiwa&nbsp;lawyerpreneur&nbsp;yang\n  berwawasan indonesia secara khusus, serta ASEAN dan internasional secara umum\n  yang menguasai ilmu hukum bisnis.</span></li><li><span lang=\"EN-US\">Membangun karakter sivitas akademika\n  yang profesional, kompeten, berintegritas, berbudaya Indonesia, dan mampu\n  bersaing menghadapi tantangan global di bidang hukum bisnis.</span></li><li><span lang=\"EN-US\">Memenuhi kebutuhan dan harapan\n  universitas dengan penerapan standar mutu pembelajaran yang mengacu pada\n  standar internasional serta penguasaan ilmu pengetahuan dan teknologi\n  (IPTEK).</span></li></ol>', NULL, '2020-01-03 10:32:31', '3019024');
INSERT INTO `prodi_texting` VALUES (40, 6, 1, NULL, 'testimonials', NULL, '<span>Podomoro University provides valuable lessons and experiences, both theory and practice. Since 2nd semester, I’ve interned in government offices and law firm, a very valuable and useful experience for a career in the workforce. Familiarity and high sense of solidarity in law majors and other departments, providing warmth in campus and encouragement to implement knowledge.</span>\n\n', NULL, '2020-01-03 10:44:29', '3019024');
INSERT INTO `prodi_texting` VALUES (41, 6, 1, NULL, 'testimonials', NULL, '&nbsp;<span>During my studies in Podomoro University, I was taught by experienced lecturers and practitioners as well, campus facilities were satisfying and many practices. So we as Podomoro students will be well prepared in practical world.</span>\n\n', NULL, '2020-01-03 10:45:19', '3019024');
