margin:36.0pt;\n	mso-paper-source:0;}\ndiv.WordSection1\n	{page:WordSection1;}\n-->\n</style>\n<!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\n	mso-para-margin-top:0cm;\n	mso-para-margin-right:0cm;\n	mso-para-margin-bottom:8.0pt;\n	mso-para-margin-left:0cm;\n	line-height:107%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n<p>Selamat Datang di Website resmi Program\nStudi Manajemen dan Rekayasa Konstruksi<o:p></o:p></p>\n\n<p>Program Studi Manajemen dan Rekayasa\nKonstruksi telah berdiri sejak tahun 2014 dan senantiasa berkomitmen untuk\nmeningkatkan mutu dan kualitas lulusannya dengan bekerja sama dengan Perguruan\nTinggi di Luar Negeri dalam kerangka kerja sama Tridharma Perguruan Tinggi\nseperti Babson College, UTM Space dan asosiasi seperti Ikatan Quantity Surveor\nIndonesia, Persatuan Insinyur Indonesia dan Project Management Institute.<o:p></o:p></p>\n\n<p>Kerjasama yang telah dilakukan dijabarkan\nmelalui program-program seperti Kegiatan Kuliah Tamu, Seminar, Pemutakhiran\nKurikulum dan Penelitian serta Peningkatan kualitas dosen dibidang <i>Entrepreneurship Mindset.</i> <o:p></o:p></p>\n\n<p>Dalam pengajarannya Program Studi\nManajemen Rekayasa Konstruksi menerapkan metode “<em>Experiential Learning</em>”\nberdasarkan Entreprenurship Taught and Action (ETA) di mana para mahasiswa\nmerasakan pengalaman magang lebih banyak di lingkungan Industri Konstruksi di\nperusahaan Kelompok Usaha Agung Podomoro Land (APL) maupun diluar Kelompok Usaha\nAPL.<o:p></o:p></p>\n\n<p>Ditahun 2018 Program Studi Manajemen\nRekayasa Konstruksi telah meluluskan 7 mahasiswa dari batch 1 (2014), dimana\n&gt;75% langsung bekerja dengan masa tunggu kurang dari 6 bulan dan Ditahun 2019\nProgram Studi meluluskan 10 mahasiswa dari batch 1 dan batch 2 degan &gt;75%\nlangsung bekerja dengan masa tunggu kurang dari 6 bulan.</p><p><o:p><br></o:p></p><p><o:p>Akhir kata, semoga Website ini dapat memberikan informasi yang lengkap bagi semua pihak.</o:p></p><p><o:p><br></o:p></p><p><o:p>Terima Kasih</o:p></p>\n\n<p><o:p>&nbsp;</o:p></p>\n\n<p class=\"MsoNormal\">Kaprodi Manajemen dan Rekayasa Konstruksi<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 12pt;\">&nbsp;</span></p>\n\n<p class=\"MsoNormal\"><o:p>&nbsp;</o:p></p>\n\n<!--EndFragment-->', NULL, '2020-01-07 09:08:34', '2218002');
INSERT INTO `prodi_texting` VALUES (43, 2, 1, NULL, 'welcoming', NULL, '\n<!--StartFragment--><span class=\"tlid-translation translation\" lang=\"en\">Welcome to the official website of the Construction Management and Engineering Study Program<br><br>The Construction Management and Engineering Study Program has been established since 2014 and is always committed to improving the quality and quality of its graduates by collaborating with Higher Education Abroad within the framework of Tridharma Perguruan Tinggi such as Babson College, UTM Space and associations such as the Indonesian Quantity Surveillance Association, Indonesian Engineers Association and Project Management Institute.<br><br>The collaboration that has been carried out is elaborated through programs such as Guest Lecture Activities, Seminars, Curriculum Updates and Research and Improving the quality of lecturers in the field of Entrepreneurship Mindset.<br><br>In teaching, the Construction Engineering Management Study Program applies the \"Experiential Learning\" method based on Entrepreneurship Taught and Action (ETA) where students feel more internship experience in the Construction Industry environment in the company of the Agung Podomoro Land Business Group (APL) or outside the APL Business Group.<br><br>In 2018 the Construction Engineering Management Study Program graduated 7 students from batch 1 (2014), of which&gt; 75% directly worked with a waiting period of less than 6 months and in 2019 the Study Program graduated 10 students from batch 1 and batch 2 with&gt; 75% directly work with a waiting period of less than 6 months.<br><br><br>Finally, I hope this website can provide complete information for all parties.<br><br><br>Thank you<br><br> <br><br>Head of Construction Management and Engineering</span><!--EndFragment-->\n\n', NULL, '2020-06-29 16:49:05', '1019027');
INSERT INTO `prodi_texting` VALUES (44, 2, 2, NULL, 'whychoose', NULL, '<!--StartFragment--><p class=\"MsoNormal\" style=\"\">Program Studi D4 Manajemen dan Rekayasa Konstruksi Universitas Agung Podomoro (Prodi D4 MRK) adalah Program Studi yang siap mencetak tenaga kerja konstruksi berkompeten untuk mendukung target pembangunan nasional.&nbsp;&nbsp;</p><p class=\"MsoNormal\" style=\"\"><!--StartFragment-->Belajar di program studi ini dapat memberikan tantangan tersendiri. Mahasiswa yang belajar di Prodi D4 MRK senantiasa diberi tantangan untuk mengembangkan kompetensi mereka di bidang konstruksi dengan metode pembelajaran kolaboratif berbasis proyek konstruksi. Interaksi antar sesama mahasiswa dan dosen akan membuat proses pembelajaran menyenangkan dan mencapai tujuannya secara efektif.<!--EndFragment-->&nbsp;&nbsp;<br></p><p class=\"MsoNormal\"><span style=\"font-size: 11pt;\"><br></span></p><br><p class=\"MsoNormal\" style=\"text-align: justify; \"><o:p>&nbsp;</o:p></p><!--EndFragment--><style>\n<!--\n /* Font Definitions */\n @font-face\n	{font-family:\"Cambria Math\";\n	panose-1:2 4 5 3 5 4 6 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:roman;\n	mso-font-pitch:variable;\n	mso-font-signature:-536869121 1107305727 33554432 0 415 0;}\n@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-469750017 -1073732485 9 0 511 0;}\n /* Style Definitions */\n p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:\"\";\n	margin-top:0cm;\n	margin-right:0cm;\n	margin-bottom:8.0pt;\n	margin-left:0cm;\n	line-height:107%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n.MsoChpDefault\n	{mso-style-type:export-only;\n	mso-default-props:yes;\n	font-family:\"Calibri\",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n.MsoPapDefault\n	{mso-style-type:export-only;\n	margin-bottom:8.0pt;\n	line-height:107%;}\n@page WordSection1\n	{size:612.0pt 792.0pt;\n	margin:72.0pt 72.0pt 72.0pt 72.0pt;\n	mso-header-margin:36.0pt;\n	mso-footer-margin:36.0pt;\n	mso-paper-source:0;}\ndiv.WordSection1\n	{page:WordSection1;}\n-->\n</style>', NULL, '2020-02-20 15:18:57', '2218002');
