konstruksi, seperti Ikatan\nQuantity Surveyor Indonesia (IQSI) dan Balai Jasa Konstruksi Kementerian\nPekerjaan Umum dan Perumahan Rakyat, lulusan MRK akan dibekali dengan\nsertifikat kompetensi yang menyertai ijazah kelulusan, Sertifikat ini akan\nmenjadi nilai tambah bagi lulusan MRK di dalam industri konstruksi. Program\nStudi D4 Manajemen dan Rekayasa Konstruksi Universitas Agung Podomoro adalah\nProgram Studi yang siap mencetak tenaga kerja konstruksi berkompeten untuk\nmendukung target pembangunan nasional.<span><o:p></o:p></span></p>\n\n<!--EndFragment-->', NULL, '2020-01-07 09:29:22', '2218002');
