INSERT INTO `prodi_texting` VALUES (48, 2, 1, NULL, 'career', NULL, '<!--StartFragment--><p>1. Junior Quantity Surveyor</p><p>2. Project Engineer</p><p>3. Field Engineer</p><p>4. Project Quality Control</p><p>5. Project Scheduler</p><p>6. Building Maintenance</p><p>7. Junior Contract Administrator</p><p>8. Laboratory Staff</p><!--EndFragment-->', NULL, '2020-01-07 09:42:00', '2218002');
INSERT INTO `prodi_texting` VALUES (49, 2, 1, NULL, 'testimonials', NULL, 'Besides I\'m learning about construction, I\'m also interested in Entrepreneurial Mindset to think creatively and innovatively', NULL, '2020-01-07 12:02:45', '1019027');
INSERT INTO `prodi_texting` VALUES (50, 2, 1, NULL, 'testimonials', NULL, 'Podomoro University has opened up my opportunity to go directly into the world of construction. The various internship programs offered have given me more experience before entering the workforce', NULL, '2020-01-07 12:10:10', '1019027');
INSERT INTO `prodi_texting` VALUES (51, 6, 1, NULL, 'graduate', NULL, '<p><span lang=\"EN-US\">Program studi hukum bisnis\nuniversitas agung podomoro menyajikan kurikulum berbasis kkni dengan menekankan\nkepada penerapan skill sehingga dapat memiliki lulusan yang profesional dalam\n:&nbsp;</span></p><span>\n\n</span><ul><li><span lang=\"EN-US\">melakukan penelitian di bidang hukum bisnis untuk kepentingan akademis\ndan praktis;</span></li><li><span lang=\"EN-US\">memberikan pendapat hukum (<i>legal opinion</i>) yang komprehensif;</span></li><li><span lang=\"EN-US\">membuat perjanjian bisnis dalam lingkup nasional maupun internasional; dan</span></li><li><span lang=\"EN-US\">mengerjakan uji tuntas (<i>legal due dilligence</i>) khususunya terkait\ndengan hukum bisnis, berfikir dan membentuk suatu bisnis.</span></li></ul>', NULL, '2020-01-13 10:56:28', '3019024');
