n>Menyelenggarakan\npendidikan tinggi arsitektur yang mengajarkan ilmu arsitektur dan keterampilan\nmerancang lingkungan binaan yang lintas disiplin secara terintegrasi dengan pengalaman\npraktek profesi dan industri.<o:p></o:p></span></p>\n\n</p><p><p class=\"MsoListParagraphCxSpMiddle\"><!--[if !supportLists]--><span><span><span></span></span></span><span>Menyelenggarakan\nkegiatan penelitian dan pengabdian masyarakat yang berwawasan global sebagai\nwujud tanggung jawab sosial program studi.<o:p></o:p></span></p>\n\n</p><p><p class=\"MsoListParagraphCxSpMiddle\"><!--[if !supportLists]--><span><span><span></span></span></span><!--[endif]--><span>Membangun\nkebanggaan dan keunggulan program studi melalui kerjasama pengajaran,\npenelitian dan pengabdian masyarakat melalui jejaring internal maupun\neksternal, berskala regional maupun internasional.<o:p></o:p></span></p>\n\n</p><p><p class=\"MsoListParagraphCxSpMiddle\"><!--[if !supportLists]--><span><span><span></span></span></span><span>Menyelenggarakan\npengendalian mutu proses pembelajaran dan penyediaan sarana/prasarana yang\nlengkap dengan akses yang mudah bagi setiap mahasiswanya.<o:p></o:p></span></p>\n\n</p><p><p class=\"MsoListParagraphCxSpLast\"><!--[if !supportLists]--><span><span><span></span></span></span><span>Menghasilkan\nLulusan yang memiliki kompetensi dalam ilmu arsitektur, keterampilan merancang,\nbertanggungjawab, berwawasan global dan berjiwa wirausaha.<o:p></o:p></span></p>\n\n<!--EndFragment-->\n\n\n\n</p>', NULL, '2020-01-13 11:09:50', '2114033');
INSERT INTO `prodi_texting` VALUES (54, 1, 2, NULL, 'welcoming', NULL, '\n<!--StartFragment--><p>Adli Nadia</p><p>Magister Perancangan,&nbsp; Institut Teknologi Bandung; Sarjana Arsitektur, Universitas Diponegoro.<br>\n	<br>\n	Adli Nadia adalah dosen program studi Arsitektur. Beliau mendalami perancangan dan komputasi dari Instutitut Teknologi Bandung Indonesia. Saat ini, riset yang di dalami oleh beliau berkaitan erat dengan eksperimen arsitektur, simulasi, perilaku dan komputasi desain.</p><p>Sebagai seorang dosen yang berpraktek di industri, karya dan hasil rancangannya memiliki karakterisktik yang kuat pada eksplorasi ruang, ketukangan dan pemaknanaan. Selain itu, beliau juga memiliki pengalaman yang luas dalam merancang lingkungan binaan yang berskala besar seperti bangunan komersial \"Mixed use\", hingga rumah tinggal dengan skala yang karakternya sangat personal.</p><!--EndFragment-->\n\n', NULL, '2020-01-13 11:18:30', '2114033');
INSERT INTO `prodi_texting` VALUES (55, 1, 1, NULL, 'vision', NULL, '<p>\n<!--StartFragment--><i><span>\n<!--StartFragment--><span class=\"tlid-translation translation\" tabindex=\"-1\" lang=\"en\"><span title=\"\" class=\"\">In 2020, Podomoro University Department of Architecture will become a leading program that creates a good quality built environment through an integrated education system including theoretical studies and professional practice together with the industries, develops global visions, and&nbsp;</span></span></span></i><i><span class=\"tlid-translation translation\" tabindex=\"-1\" lang=\"en\"><span title=\"\" class=\"\">produces competent graduates with entrepreneurial spirit, and promotes Indonesian culture.</span></span>&nbsp;</i></p><p><!--EndFragment-->\n\n</p>', NULL, '2020-01-29 14:24:46', '2114033');
INSERT INTO `prodi_texting` VALUES (56, 1, 1, NULL, 'mission', NULL, '\n<!--StartFragment--><span class=\"tlid-translation translation\" lang=\"en\"><span title=\"\" class=\"\">Conducting a higher education that teaches architectural knowledge and skills in designing an interdisciplinary built environment through an integrated with professional and practical experiences in industries.</span><br><br><span title=\"\">Constituting research activities and community services with a global vision as a form of social responsibility.</span><br><br><span title=\"\">Building pride and excellence in study programs through collaborative teaching, research and community service through internal and external networks, regionally and internationally.</span><br><br><span title=\"\">Executing a quality control of learning process and provision of facilities / infrastructure that is comprehensive and accessible by each student.</span><br><br><span title=\"\">Producing graduates who have competence in architecture knowledge, design skills, responsibility, global vision and entrepreneurial spirit.</span></span><!--EndFragment-->\n\n', NULL, '2020-01-29 14:40:09', '2114033');
