Priority=\"52\"\n   Name=\"List Table 7 Colorful Accent 5\"></w:LsdException>\n  <w:LsdException Locked=\"false\" Priority=\"46\"\n   Name=\"List Table 1 Light Accent 6\"></w:LsdException>\n  <w:LsdException Locked=\"false\" Priority=\"47\" Name=\"List Table 2 Accent 6\"></w:LsdException>\n  <w:LsdException Locked=\"false\" Priority=\"48\" Name=\"List Table 3 Accent 6\"></w:LsdException>\n  <w:LsdException Locked=\"false\" Priority=\"49\" Name=\"List Table 4 Accent 6\"></w:LsdException>\n  <w:LsdException Locked=\"false\" Priority=\"50\" Name=\"List Table 5 Dark Accent 6\"></w:LsdException>\n  <w:LsdException Locked=\"false\" Priority=\"51\"\n   Name=\"List Table 6 Colorful Accent 6\"></w:LsdException>\n  <w:LsdException Locked=\"false\" Priority=\"52\"\n   Name=\"List Table 7 Colorful Accent 6\"></w:LsdException>\n </w:LatentStyles>\n</xml><![endif]--><!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin-top:0in;\n	mso-para-margin-right:0in;\n	mso-para-margin-bottom:8.0pt;\n	mso-para-margin-left:0in;\n	line-height:107%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",\"sans-serif\";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]--><!--StartFragment--><span style=\"font-size: 18px;\">\n\n</span><p class=\"MsoNormal\" style=\"line-height: 1.2;\" align=\"justify\"><span style=\"font-size: 18px;\">Arsitektur adalah </span><span style=\"font-size: 18px;\" lang=\"IN\">bagian yang tidak terpisahkan</span><span style=\"font-size: 18px;\" lang=\"IN\">\n</span><span style=\"font-size: 18px;\">dari kehidupan kita. Desain yang baik, sering tanpa disadari,\nmemfasilitasi aktivitas kehidupan sehari-hari dengan harmoni. Sehingga, merupakan\ntantangan bagi arsitek untuk menciptakan ruang yang selaras dengan aktivitas\nyang terjadi di dalamnya. (Ching, 2013)</span></p><p class=\"MsoNormal\" style=\"line-height: 1.2;\" align=\"justify\"><o:p><br></o:p></p><span style=\"font-size: 18px;\">\n\n</span><p class=\"MsoNormal\" style=\"line-height: 1.2;\" align=\"justify\"><span style=\"font-size: 18px;\">Ilmu arsitektur sangatlah\nkompleks, di dalamnya terdapat studi artistik dan teknis yang melibatkan suatu\nproses kreatif yang intuitif namun tetap seiring dengan azas-azas akademis.\nProses merancang merupakan penekanan pada pembelajaran arsitektur, proses ini\nmerupakan iterasi non linear yang melibatkan beripikir kreatif, kritis,\nstrategis serta mampu mengidentifikasi dan menyelesaikan masalah dengan akurat.</span></p><p class=\"MsoNormal\" style=\"line-height: 1.2;\" align=\"justify\"><o:p><br></o:p></p><span style=\"font-size: 18px;\">\n\n</span><p class=\"MsoNormal\" style=\"line-height: 1.2;\" align=\"justify\"><span style=\"font-size: 18px;\">Pembelajaran tentang arsitektur\njuga melibatkan manusia dari beragam perspektif, antara lain: menggunakan,\nmengalami, memahami, membuat. Dalam hal ini, pendidikan arsitektur sebaiknya\nmelibatkan industri sehingga pemahamannya terhadap sebuah lingkungan binaan menjadi\nmenyeluruh dan utuh. Dengan dukungan perusahaan induk, Universitas Podomoro\ndibekali oleh sejumlah afiliasi yang bergerak di ranah arsitektur, mulai dari\npengembang, perencana, pengawas, kontraktor, hingga unit-unit pendukung lain,\nsebagai sarana pembelajaran nyata (Lab organik) yang dapat mengasah kemampuan\nberpikir secara menyeluruh.</span><o:p></o:p></p><span style=\"font-size: 18px;\">\n\n</span><!--EndFragment--><span style=\"font-size: 18px;\">\n\n\n\n</span>', NULL, '2020-01-13 12:03:02', '2114033');
INSERT INTO `prodi_texting` VALUES (58, 1, 2, NULL, 'graduate', NULL, '\n\n\n\n<div style=\"\" align=\"justify\"><meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\"><meta name=\"ProgId\" content=\"Word.Document\"><meta name=\"Generator\" content=\"Microsoft Word 15\"><meta name=\"Originator\" content=\"Microsoft Word 15\"><link rel=\"File-List\" href=\"file:///C:\\Users\\wila\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_filelist.xml\">\n<link rel=\"themeData\" href=\"file:///C:\\Users\\wila\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_themedata.thmx\">\n<link rel=\"colorSchemeMapping\" href=\"file:///C:\\Users\\wila\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_colorschememapping.xml\">\n\n<style>\n<!--\n /* Font Definitions */\n @font-face\n	{font-family:\"Cambria Math\";\n	panose-1:2 4 5 3 5 4 6 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:roman;\n	mso-font-pitch:variable;\n	mso-font-signature:-536869121 1107305727 33554432 0 415 0;}\n@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-469750017 -1073732485 9 0 511 0;}\n /* Style Definitions */\n p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:\"\";\n	margin-top:0in;\n	margin-right:0in;\n	margin-bottom:8.0pt;\n	margin-left:0in;\n	line-height:107%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",\"sans-serif\";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n.MsoChpDefault\n	{mso-style-type:export-only;\n	mso-default-props:yes;\n	font-family:\"Calibri\",\"sans-serif\";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:Calibri;\n	mso-fareast-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n.MsoPapDefault\n	{mso-style-type:export-only;\n	margin-bottom:8.0pt;\n	line-height:107%;}\n@page WordSection1\n	{size:8.5in 11.0in;\n	margin:1.0in 1.0in 1.0in 1.0in;\n	mso-header-margin:.5in;\n	mso-footer-margin:.5in;\n	mso-paper-source:0;}\ndiv.WordSection1\n	{page:WordSection1;}\n-->\n</style>\n\n\n\n\n<span>Lulusan\nprodi arsitektur Podomoro University diharapkan mempunyai profil yang akan\nmendukung eksistensi dirinya dan karirnya di bidang arsitektur. Disamping\nkemampuan khusus pada bidang perancangan arsitektur seperti menyusun ide dan\ngagasan, menyusun konsep rancangan, serta mengkomunikasikan hasil karyanya,\npara lulusan juga diharapkan dapat mempunyai dan menunjukkan sikap dan tata\nnilai yang sesuai dengan Pancasila dan berbudaya Indonesia. Selain itu, para\nlulusan juga diharapkan mempunyai jiwa kewirausahaan, menjunjung tinggi\nintegritas dan etika, serta berwawasan global, dan mampu bekerja lintas\ndisiplin.</span></div>\n\n\n\n\n<!--[if gte mso 9]><xml>\n <o:OfficeDocumentSettings>\n  <o:AllowPNG></o:AllowPNG>\n </o:OfficeDocumentSettings>\n</xml><![endif]--><!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves></w:TrackMoves>\n  <w:TrackFormatting></w:TrackFormatting>\n  <w:PunctuationKerning></w:PunctuationKerning>\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\n  <w:LidThemeAsian>JA</w:LidThemeAsian>\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables></w:Brea