k\nperencana, baik perencana bangunan, kota, maupun interior.</span></li><li><span>Arsitek\nin-house, yang bekerja untuk perawatan, perbaikan, dan pengembangan secara\nberkala dari suatu kepengelolaan gedung.<o:p><br></o:p></span></li><li><span>Kontraktor\npelaksana, yang mewujudkan suatu rancangan menjadi karya nyata.</span></li><li><span>Pengembang\nProperty, yang membutuhkan keahlian sebagai perencana yang berkaitan erat\ndengan perhitungan rencana bisnis dan tahapan pengembangan.</span><span><span><span><br></span></span></span></li><li><span>Konsultan\nkhusus pendukung arsitek perencana, yang bertugas memberikan jasa<span> profesional yang fokus membantu\narsitek dalam berinovasi dan berkreasi seperti konsultan fasade, konsultan <i>green building</i>, konsultan pencahayaan,\ndsb</span></span></li><li><span>Akademisi arsitektur, yang fokus pada pengembangan\nkeilmuan arsitektur dan pendidikan arsitektur seperti peneliti arsitektur dan\ndosen.</span><span><o:p><br></o:p></span></li><li><span>Bidang lainnya yang membutuhkan pengetahuan akan arsitektur dan\nkemampuan</span><span>\nakan proses berpikir yang runut dan terbiasa berpikir secara kritis dan\nstrategis <span>sebagai landasan\npekerjaannya seperti penilai property, periklanan, <i>multimedia, </i>dsb.</span></span>\n\n\n\n</li></ul>', NULL, '2020-01-13 12:10:32', '2114033');
