span><o:p></o:p></span></p>\n\n<ul><li style=\"margin-left: 23px;\"><!--[if !supportLists]--><span><span><span></span></span></span><!--[endif]--><span>Merupakan bagian dari Agung Podomoro Group,\nsebuah perusahaan pengembang property terbesar di Indonesia. Dengan demikian\naktivitas belajar dan perkembangan prodi didukung penuh oleh PT Agung Podomoro\nLand Tbk/Agung Podomoro Group.</span></li><li style=\"margin-left: 23px;\"><span>Bekerja dengan Babson Global Inc, dari Babson\nCollege USA, sebuah perguruan tinggi terbaik di AS dalam bidang kewirausahaan.\nKerjasama ini menghasilkan suatu pembekalan keilmuan dan praktik dalam\nmembentuk karakter dan jiwa kewirausahaan mahasiswa.</span></li><li style=\"margin-left: 23px;\"><span>Konsep\npendidikan arsitektur yang mengasah kemampuan mahasiswa untuk merancang\ndisertai oleh kemampuan penyelesaian masalah dengan kreativitas tinggi namun\nkritis dalam menganalisa dan mengambil keputusan sebagai bekal utama profesi\narsitek di masa yang akan datang.</span></li><li style=\"margin-left: 23px;\"><span>Metoda\npembelajaran yang unik dengan menyertakan <i>design\nthinking</i> serta iterasinya dan <i>design\nby research</i> untuk membiasakan proses penggalian masalah dan solusinya.</span><span><span><span><br></span></span></span></li><li style=\"margin-left: 23px;\"><span>Proses pembelajaran lintas disiplin dengan\nintegrasi dan kolaborasi antar prodi, meliputi tugas kuliah yang membutuhkan\nwawasan disiplin lain, serta penilaian tugas yang melibatkan narasumber dari\nindustri, dan pengayaan wawasan melalui dosen tamu. </span></li><li style=\"margin-left: 23px;\"><span>Program magang di konsultan-konsultan perencana\narsitektur ternama di Indonesia sebagai bagian dari aplikasi di lapangan dan\nmembiasakan iklim profesionalisme.<o:p><br></o:p></span></li><li style=\"margin-left: 23px;\"><span>Proses belajar mata kuliah\ninti Studio Desain Arsitektur yang sangat aplikatif dengan menjadikan\nproyek-proyek di PT Agung Podomoro City menjadi laboratorium organik sebagai\nbahan pembelajaran akan aplikasi di lapangan.</span>\n\n\n\n</li></ul><p></p>', NULL, '2020-01-14 17:26:03', '2114033');
