ize:8.5in 11.0in;\n	margin:1.0in 1.0in 1.0in 1.0in;\n	mso-header-margin:.5in;\n	mso-footer-margin:.5in;\n	mso-paper-source:0;}\ndiv.WordSection1\n	{page:WordSection1;}\n-->\n</style>\n<!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin-top:0in;\n	mso-para-margin-right:0in;\n	mso-para-margin-bottom:10.0pt;\n	mso-para-margin-left:0in;\n	line-height:115%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",\"sans-serif\";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n\n\n<!--EndFragment--></p><p class=\"MsoNormal\">Learning about architecture will introduce people to various perspectives, including: utilizing, experiencing, understanding, and creating.&nbsp;<span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">In this case, architectural education should involve real industries so its\nunderstanding of a built environment becomes comprehensive and holistic. </span></p><p class=\"MsoNormal\"><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">Supported by the parent company, Podomoro University is equipped with a number of\n</span><span style=\"font-family: &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 13px;\">affiliations engaging in architecture industries, such as&nbsp;</span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">developers,\nplanners, controllers, contractors, and other supportive units. It provides a unique advantage as a learning\ntool (Organic Lab) that sharpens the thinking ability.</span></p></div><p class=\"MsoNormal\"><o:p></o:p></p>\n\n<!--EndFragment-->', NULL, '2020-01-14 17:29:28', '2114033');
