tyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin-top:0in;\n	mso-para-margin-right:0in;\n	mso-para-margin-bottom:10.0pt;\n	mso-para-margin-left:0in;\n	line-height:115%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",\"sans-serif\";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n\n\n<p>Podomoro University Department of Architecture offers unique advantages that support the teaching and learning process in architecture study.</p><p></p><p>These advantages include:<o:p></o:p></p><p><!--StartFragment--><!--EndFragment--></p><ul><li>Podomoro University is part of Agung Podomoro Group, the largest property development company in Indonesia. Learning activities and study program developments are fully supported by PT Agung Podomoro Land Tbk / Agung Podomoro Group.</li><li>Collaboration with Babson Global, Inc., best college for entrepreneurship education in the United States of America, provides Podomoro University\'s students with both academic and practical knowledge to create entrepreneur character and spirit.</li><li><span>Architectural education concept that sharpens both design ability and problem solving skill with a high level of creativity, yet, generate a critical thinking in analyzing and decision making, which in the future would be the main skill for architectural profession.</span></li><li>Unique learning method that combines design thinking and iterations with design by research allowing students to be able to identify problems and their solutions.</li><li>Interdisciplinary learning process that integrates and collaborates between study programs, such as collaboration of lecture assignments with other disciplines, assessments by specialists in the industry, knowledge sharing by guest lecturers.</li><li>Internship programs in leading architectural planning consultants in Indonesia to learn about real practices and professionalism.</li><li>Applicable Architecture Design Studio core courses that is integrated with real projects in PT Agung Podomoro City to provide with practical materials and become an organic laboratory.</li></ul><ul><li><o:p></o:p></li></ul>\n\n\n\n\n\n\n\n\n\n<!--EndFragment--><style>\n<!--\n /* Font Definitions */\n @font-face\n	{font-family:SimSun;\n	panose-1:2 1 6 0 3 1 1 1 1 1;\n	mso-font-alt:??;\n	mso-font-charset:134;\n	mso-generic-font-family:auto;\n	mso-font-pitch:variable;\n	mso-font-signature:3 680460288 22 0 262145 0;}\n@font-face\n	{font-family:SimSun;\n	panose-1:2 1 6 0 3 1 1 1 1 1;\n	mso-font-alt:??;\n	mso-font-charset:134;\n	mso-generic-font-family:auto;\n	mso-font-pitch:variable;\n	mso-font-signature:3 680460288 22 0 262145 0;}\n@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-536870145 1073786111 1 0 415 0;}\n@font-face\n	{font-family:\"\\@SimSun\";\n	panose-1:2 1 6 0 3 1 1 1 1 1;\n	mso-font-charset:134;\n	mso-generic-font-family:auto;\n	mso-font-pitch:variable;\n	mso-font-signature:3 680460288 22 0 262145 0;}\n /* Style Definitions */\n p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:\"\";\n	margin-top:0in;\n	margin-right:0in;\n	margin-bottom:10.0pt;\n	margin-left:0in;\n	line-height:115%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",\"sans-serif\";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:SimSun;\n	mso-fareast-theme-font:minor-fareast;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n.MsoChpDefault\n	{mso-style-type:expo