le-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin-top:0in;\n	mso-para-margin-right:0in;\n	mso-para-margin-bottom:10.0pt;\n	mso-para-margin-left:0in;\n	line-height:115%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",\"sans-serif\";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n<p class=\"MsoNormal\">Podomoro University Department of Architecture\'s graduates are expected to have an outstanding profile that will support their personal existence and architecture career. Graduates would not only gain architectural design skills such as<span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">&nbsp;creating ideas, developing design\nconcepts, and communicating their works, but they would also be able to demonstrate attitudes and values based on Pancasila and Indonesian culture.&nbsp;</span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">In addition, graduates are also expected to\nhave entrepreneurial spirit, promote integrity and professional ethics, acquire global vision and&nbsp;</span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">be able to work across disciplines.</span></p><p class=\"MsoNormal\"><o:p></o:p></p>\n\n<!--EndFragment-->', NULL, '2020-01-22 17:16:07', '2114033');
INSERT INTO `prodi_texting` VALUES (70, 1, 1, NULL, 'career', NULL, '<p>Podomoro University Department of Architecture graduates&nbsp;<span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">are intended to get careers related to architectural design techniques and any other business associated&nbsp;</span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">with architecture. Their career opportunities include:</span></p><ul><li>Architectural Planner, who could be a building architect, an urban planner, or an interior design.</li><li>In House Architect, who involves in maintenance, repairs\nand regular development of building management.</li><li>Contractor, who creates a design into a real work.</li><li>Property Developer,&nbsp;that requires expertise as a planner to do property business plan and development.<!--EndFragment--></li><li><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">Special consultant, who supports&nbsp;</span>architecture planner, whose job is to provide professional services that focus on innovating and creating special designs, such as facade consultants, green building consultants, lighting consultants, etc.<!--EndFragment--></li><li><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">Architectural scholars,&nbsp;</span>who focuses on architectural science and architecture education, such as architectural researchers and lecturers.<!--EndFragment--></li><li>Other related fields that require architectural knowledge, ability to think through a continuous process, critical and strategic thinking, as their basic skills, such as property valuers,\nadvertising, multimedia, etc.</li><li><p class=\"MsoNormal\"><o:p></o:p></p>\n\n<!--EndFragment--></li></ul>\n\n<!--EndFragment--><style>\n<!--\n /* Font Definitions */\n @font-face\n	{font-family:SimSun;\n	panose-1:2 1 6 0 3 1 1 1 1 1;\n	mso-font-alt:??;\n	mso-font-charset:134;\n	mso-generic-font-family:auto;\n	mso-font-pitch:variable;\n	mso-font-si