INSERT INTO `prodi_texting` VALUES (71, 1, 1, NULL, 'testimonials', NULL, 'Podomoro University has successfully proved its promises since my 3 years of college here. In academic aspects, I am truly amazed by the knowledge that I have received from various lectures who are active in academic world and practical industry. Regarding entrepreneurship, PU has been successful in forming me to be a risk taker and a responsible person to face challenges, not only in campus, but also in facing clients or consumers.&nbsp;', NULL, '2020-01-29 14:59:32', '2114033');
