tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin-top:0in;\n	mso-para-margin-right:0in;\n	mso-para-margin-bottom:10.0pt;\n	mso-para-margin-left:0in;\n	line-height:115%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",\"sans-serif\";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n<p class=\"MsoNormal\"><!--StartFragment-->In my opinion, studying at Podomoro University is fun. I could feel a close relationship between lecturers and students; and we can have a good communication. I get friends who feel like a family. In terms of material, I think it\'s good since it is very comprehensive (we get a digital architecture class which other university doesn\'t offer). However, sometimes lecturers are not aligned; materials about details and constructions could be improved too. Other than that, it\'s pretty impressive.&nbsp;&nbsp;</p><p class=\"MsoNormal\"><br></p>\n\n<!--EndFragment--><!--EndFragment-->', NULL, '2020-01-30 15:07:59', '2114033');
