"37\" Name=\"Bibliography\"></w:LsdException>\n  <w:LsdException Locked=\"false\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\"></w:LsdException>\n </w:LatentStyles>\n</xml><![endif]-->\n<style>\n<!--\n /* Font Definitions */\n @font-face\n	{font-family:SimSun;\n	panose-1:2 1 6 0 3 1 1 1 1 1;\n	mso-font-alt:??;\n	mso-font-charset:134;\n	mso-generic-font-family:auto;\n	mso-font-pitch:variable;\n	mso-font-signature:3 680460288 22 0 262145 0;}\n@font-face\n	{font-family:SimSun;\n	panose-1:2 1 6 0 3 1 1 1 1 1;\n	mso-font-alt:??;\n	mso-font-charset:134;\n	mso-generic-font-family:auto;\n	mso-font-pitch:variable;\n	mso-font-signature:3 680460288 22 0 262145 0;}\n@font-face\n	{font-family:Calibri;\n	panose-1:2 15 5 2 2 2 4 3 2 4;\n	mso-font-charset:0;\n	mso-generic-font-family:swiss;\n	mso-font-pitch:variable;\n	mso-font-signature:-536870145 1073786111 1 0 415 0;}\n@font-face\n	{font-family:\"\\@SimSun\";\n	panose-1:2 1 6 0 3 1 1 1 1 1;\n	mso-font-charset:134;\n	mso-generic-font-family:auto;\n	mso-font-pitch:variable;\n	mso-font-signature:3 680460288 22 0 262145 0;}\n /* Style Definitions */\n p.MsoNormal, li.MsoNormal, div.MsoNormal\n	{mso-style-unhide:no;\n	mso-style-qformat:yes;\n	mso-style-parent:\"\";\n	margin-top:0in;\n	margin-right:0in;\n	margin-bottom:10.0pt;\n	margin-left:0in;\n	line-height:115%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",\"sans-serif\";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:SimSun;\n	mso-fareast-theme-font:minor-fareast;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n.MsoChpDefault\n	{mso-style-type:export-only;\n	mso-default-props:yes;\n	font-family:\"Calibri\",\"sans-serif\";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-fareast-font-family:SimSun;\n	mso-fareast-theme-font:minor-fareast;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n.MsoPapDefault\n	{mso-style-type:export-only;\n	margin-bottom:10.0pt;\n	line-height:115%;}\n@page WordSection1\n	{size:8.5in 11.0in;\n	margin:1.0in 1.0in 1.0in 1.0in;\n	mso-header-margin:.5in;\n	mso-footer-margin:.5in;\n	mso-paper-source:0;}\ndiv.WordSection1\n	{page:WordSection1;}\n-->\n</style>\n<!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin-top:0in;\n	mso-para-margin-right:0in;\n	mso-para-margin-bottom:10.0pt;\n	mso-para-margin-left:0in;\n	line-height:115%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",\"sans-serif\";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n\n\n<!--EndFragment--></p><p class=\"MsoNormal\">Podomoro University, has a learning system that is\napplicable and has a collaborative learning system\nbetween other study programs that provides broader knowledge to be a professional architect.&nbsp;<span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">Lecturers are practitioners who have expertise in specific courses leading to a deeper learning. Most importantly, lecturers have strong ambitions towards students and learning processes, thus, it provokes student\'s interests, positive competitions and ambitions.</span></p><!--StartFragment--><!--EndFragment--><p class=\"MsoNormal\"><o:p></o:p></p>\n\n<!--EndFragment--><!--EndFragment-->', NULL, '2020-01-30 15:20:32', '2114033');
INSERT INTO `prodi_texting` VALUES (75, 3, 1, NULL, 'about', NULL, '\n<!--StartFragment--><div align=\"left\">Entrepreneurship program in Podomoro University develop students’ \nmindsets in creating values by managing&nbsp; resources innovatively and \ncreatively.&nbsp; The curriculum and&nbsp; learning method is enhanced with the \ncollaboration with the Babson Global, Inc. USA. The curriculum framework\n focuses on the experiential learning hence the students are able to \nunderstand the business creation process. theory is packaged in a \nlearning experiential where students directly execute business creating \nprocess. Through the entrepreneurial curriculum, the graduates are \nprepared to be able to face the industry world both nationally and \ninternationally.</div><!--EndFragment-->\n\n', NULL, '2020-02-18 11:33:01', '1017061');
INSERT INTO `prodi_texting` VALUES (76, 3, 1, NULL, 'excellence', NULL, '\n<!--StartFragment--><div align=\"left\">To support the learning process through experiential learning,&nbsp;Podomoro University Centre of Entrepreneurial Leaders known as PUCEL is accessible for Entrepreneurship Student and alumni to delivering innovative programs to students to help develop their entrepreneurial skills and mindset. The aim of this support system is to launch and grow ventures and awaken their entrepreneurial spirit. PUCEL arise the flagship for entrepreneurial activity in Indonesia hosting academic programs and managing student co-curricular activities that support the creation of Entrepreneurs of all Kinds in Indonesia.&nbsp; Through PUCEL, the students are expected to become active players in the Indonesian Entrepreneurship Community supporting and empowering diverse, innovative leaders while building valuable peer-to-peer connections among influential business leaders, acts as an incubator and intellectual property.</div><!--EndFragment-->\n\n', NULL, '2020-02-18 23:30:17', '1017061');
INSERT INTO `prodi_texting` VALUES (77, 3, 1, NULL, 'whychoose', NULL, '\n<!--StartFragment--><div align=\"left\">The Entrepreneurship Program of Podomoro University applies entrepreneurial thought and action that enables students to implement their knowledge and skills through experiential learning involving entrepreneurs of all kinds and practitioners from industries in some integrated project courses. It allows them to create individual values with the spirit of Entrepreneurial Leaders. Thus, the students are also encouraged to creating and developing job opportunities, adding values, having social consciousness, and lead in a global environment. Podomoro University believes that the goals are to be impactful for external communities by optimizing its resources to empower the community.<br></div><!--EndFragment-->\n\n', NULL, '2020-02-18 23:29:16', '1017061');
INSERT INTO `prodi_texting` VALUES (78, 3, 1, NULL, 'graduate', NULL, '<p>Entrepreneurship Program Podomoro University Alumni representing Entrepreneurship All of Kind in Indonesia and around the world. </p><p>They are the future leader of a national and international corporation as an Entrepreneur or Intrapreneur.</p><p>From a students first days to final days at Podomoro University, we provides an immersive experience for discovering one\'s passions and then positioning each students for success in the pursuit of them. They achieve this through personal and powerful partnership with our faculty, Industry leaders, and students</p>', NULL, '2020-02-18 23:20:38', '1017061');
INSERT INTO `prodi_texting` VALUES (79, 3, 1, NULL, 'vision', NULL, '<!--StartFragment-->Become an experiential learning based- program that produce graduates with entrepreneurial spirit, able to create values for individual and society, have analytical thinking and able to nationally and globally<!--EndFragment-->', NULL, '2020-02-18 11:59:50', '1017061');
INSERT INTO `prodi_texting` VALUES (80, 3, 1, NULL, 'mission', NULL, '<!--StartFragment--><ol><li>Develop entrepreneurial education based on experiential learning that builds knowledge, skills and entrepreneurial character</li><li>Contribute to research, development and dissemination of entrepreneurial science, and develop innovations that give benefit to the world of entrepreneurship.</li><li>Contribute in solving social problems in Indonesia through entrepreneurial oriented activities.</li></ol><!--EndFragment-->', NULL, '2020-02-18 12:01:30', '1017061');
INSERT INTO `prodi_texting` VALUES (81, 3, 1, NULL, 'welcoming', NULL, '<p><!--StartFragment-->Greetings from the office of Entrepreneurship Study Program Podomoro University. It is my great honor to lead the distinguished Program in the most entrepreneurial University in Indonesia. We dedicate the first and foremost to the students and learners, their experience, and learning outcomes.</p><p>Teaching excellence is one of our main goal and we genuinely mean it. We have faculty members with various expertise and agree with one purpose to encourage Sustainable Growth of Entrepreneurship in Indonesia.<br>We agree that Entrepreneurship Student as a Lifelong learner, cannot be compartmentalized in a semester-long course or project. Indeed, any course work, extra-curricular activity, or even graduation as a culmination of all are mere starting points of lifelong learning. The enabler of lifelong learning is also the basic characteristics of our study program. The facultys interest and expertise are the engine to guide the students to get their best performance, success and most of all happines.</p><p>For us, Entrepreneurship is more than business, its beyond Business. Not only create new ventures, but we encourage to all students and faculties to focus in giving solution,deliver value with a bigger impact, not only economic but social value. Research as the main foundation to approach complex problems in business and society We believe in mutual inspiration and cross learning to achieve the goal.</p><p>I always tried to exercise my self control in expressing how proud i am to be the member of Entrepreneurship family in Podomoro University. There are so many problems to solve in Indonesia, we need you all participate and join our big family and start to bring Entrepreneurship sustainable growth in Indonesia.</p><p><br>E-mail :&nbsp;<a rel=\"nofollow\" target=\"_blank\" href=\"mailto:wisnu.dewobroto@podomorouniversity.ac.id\">wisnu.dewobroto@podomorouniversity.ac.id</a></p><p>Instagram : @WisnuDewobroto</p><p>Mobile Phone : +62813 1415 1660.</p>', NULL, '2020-02-19 11:20:56', '1017061');
INSERT INTO `prodi_texting` VALUES (82, 3, 1, NULL, 'career', NULL, '<ul><li>Entrepreneur : a problem solver,&nbsp;a person who organizes and manages any enterprise, especially a business, usually with considerable initiative and risk</li><li>Intrapreneur :&nbsp;an employee who is tasked with developing an innovative idea or project within a company</li><li>Social Entrepeneur : a person who establishes an enterprise with the aim of solving social problems or effecting social change</li><li>Investor :&nbsp;any person or other entity (such as a firm or mutual fund) who commits capital with the expectation of receiving financial returns.&nbsp;<em>Investors</em>&nbsp;can analyze opportunities from different angles, and generally prefer to minimize risk while maximizing returns.</li><li>Business Consultant :&nbsp;&nbsp;a professional who provides professional or expert advice in a particular area such as security (electronic or physical), management, accountancy, law, human resources, marketing (and public relations), finance, engineering, science or any of many other</li><li>Business Coaching : A&nbsp;business coach&nbsp;will assist and guide the&nbsp;businessowner in running a&nbsp;business&nbsp;by helping them clarify the vision of their&nbsp;business&nbsp;and how it fits in with their personal goals.&nbsp;Business coaching&nbsp;is a process used to take a&nbsp;business&nbsp;from where it is now to where the&nbsp;business&nbsp;owner wants it to be.</li><li>Trainer :&nbsp;is an educator or instructor who works in a&nbsp;business&nbsp;environment and conveys knowledge or skills to a group of employees.</li><li>Politician :&nbsp;is a person active in party&nbsp;<em>politics</em>, or a person holding or seeking office in government.&nbsp;<em>Politicians</em>&nbsp;propose, support and create laws or policies that govern the land and, by extension, its people.</li></ul>', NULL, '2020-02-18 23:27:09', '1017061');
INSERT INTO `prodi_texting` VALUES (83, 3, 1, NULL, 'testimonials', NULL, '<!--StartFragment-->In Podomoro University, I was not only being prepared as an entrepreneur but I was trained as a leader who needs to understand well about all aspect about existing business.<!--EndFragment-->', NULL, '2020-02-19 10:52:07', '1017061');
INSERT INTO `prodi_texting` VALUES (84, 3, 1, NULL, 'testimonials', NULL, '<!--StartFragment-->Studying at Podomoro University and taking the entrepreneurship major has been a great experience for me, it provides me with a friendly and comfortable studying environment and taught me how to think out of the box so that i can be an inovative and creative leader and entrepreneur. Podomoro University also help me to improve my social and leadership skill, since it provides me with alot of self improving activities and communities such as being part of PUCEL, TAEL coach, organizing event and many others.<!--EndFragment--><!--EndFragment-->', NULL, '2020-02-19 10:52:42', '1017061');
INSERT INTO `prodi_texting` VALUES (85, 3, 2, NULL, 'whychoose', NULL, '\n<!--StartFragment--><div class=\"text-wrap tlid-copy-target\"><div class=\"result-shield-container tlid-copy-target\" tabindex=\"0\"><span class=\"tlid-translation translation\" tabindex=\"-1\" lang=\"id\"><span title=\"\" class=\"\">Program Kewirausahaan Universitas Agung Podomoro menerapkan pemikiran dan tindakan kewirausahaan yang memungkinkan siswa untuk menerapkan pengetahuan dan keterampilan mereka melalui pembelajaran dari pengalaman yang melibatkan pengusaha dari semua jenis dan praktisi dari industri dalam beberapa program proyek terintegrasi.</span> <span title=\"\" class=\"\">Ini memungkinkan mereka untuk menciptakan nilai-nilai individu dengan semangat Pemimpin Wirausaha.</span> <span title=\"\" class=\"\">Dengan demikian, para siswa juga didorong untuk menciptakan dan mengembangkan peluang kerja, menambahkan nilai-nilai, memiliki kesadaran sosial, dan memimpin dalam lingkungan global.</span> <span title=\"\" class=\"\">Universitas Agung Podomoro percaya bahwa tujuannya akan memberi dampak bagi komunitas eksternal dengan mengoptimalkan sumber dayanya untuk memberdayakan komunitas.</span></span><span class=\"tlid-translation-gender-indicator translation-gender-indicator\"></span></div></div><!--EndFragment-->\n\n', NULL, '2020-03-25 23:15:03', '1019025');
INSERT INTO `prodi_texting` VALUES (86, 3, 2, NULL, 'testimonials', NULL, '\n<!--StartFragment--><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\" class=\"\">Di Universitas Podomoro, saya tidak hanya dipersiapkan sebagai wirausaha tetapi saya dilatih sebagai pemimpin yang perlu memahami dengan baik tentang semua aspek tentang bisnis yang ada.</span></span><!--EndFragment-->\n\n', NULL, '2020-03-25 23:19:17', '1019025');
INSERT INTO `prodi_texting` VALUES (87, 3, 2, NULL, 'testimonials', NULL, '\n<!--StartFragment--><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\" class=\"\">\n<!--StartFragment--></span></span><div class=\"text-wrap tlid-copy-target\"><div class=\"result-shield-container tlid-copy-target\" tabindex=\"0\"><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\" class=\"\">Belajar di Universitas Agung Podomoro dan mengambil jurusan kewirausahaan menjadi pengalaman yang hebat bagi saya, memberi saya lingkungan belajar yang ramah dan nyaman dan mengajari saya cara berpikir lebih kreatif sehingga saya bisa menjadi pemimpin dan wirausaha yang inovatif dan kreatif.</span> <span title=\"\">Universitas Agung Podomoro juga membantu saya meningkatkan keterampilan sosial dan kepemimpinan saya, membuat saya ikut serta dalam kegiatan dan komunitas yang meningkatkan pengembangan diri saya seperti menjadi bagian dari PUCEL, pelatih TAEL, acara pengorganisasian, dan kegiatan lainnya.</span></span><span class=\"tlid-translation-gender-indicator translation-gender-indicator\"></span></div></div><!--EndFragment-->\n\n<span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\" class=\"\"><br></span></span><!--EndFragment-->\n\n', NULL, '2020-03-25 23:26:14', '1019025');
INSERT INTO `prodi_texting` VALUES (88, 3, 2, NULL, 'welcoming', NULL, '<p>\n<!--StartFragment--><span class=\"tlid-translation translation\" lang=\"id\">Salam dari Program Studi Kewirausahaan Universitas Podomoro. Merupakan kehormatan besar bagi saya untuk memimpin Program Studi terkemuka di Universitas paling berjiwa wirausaha di Indonesia. Kami mendedikasikan yang pertama dan terpenting bagi siswa dan peserta didik, pengalaman mereka, dan hasil pembelajaran.<br><br>Mengajar dengan keunggulan adalah salah satu tujuan utama kami dan kami bersungguh-sungguh. Kami memiliki anggota fakultas dengan berbagai keahlian dan setuju dengan satu tujuan untuk mendorong Pertumbuhan Kewirausahaan Berkelanjutan di Indonesia.<br>Kami setuju bahwa Mahasiswa Kewirausahaan akan belajar seumur hidupnya, tidak dapat dikotak-kotakkan dalam kursus atau proyek selama satu semester. Sesungguhnya, setiap mata kuliah, kegiatan ekstrakurikuler, atau bahkan kelulusan sebagai puncak dari semuanya hanyalah titik awal dari pembelajaran seumur hidup. Memberikan pembelajaran seumur hidup juga merupakan karakteristik dasar dari program studi kami. Minat dan keahlian fakultas adalah mesin untuk membimbing siswa untuk mendapatkan kinerja terbaik mereka, kesuksesan dan kebahagiaan.<br><br>Bagi kami, Kewirausahaan lebih dari sekadar bisnis, lebih dari Bisnis. Tidak hanya menciptakan usaha baru, tetapi kami mendorong semua siswa dan <!--StartFragment--><span class=\"gt-card-ttl-txt\">staf pengajar</span><!--EndFragment-->\n\n untuk fokus dalam memberikan solusi, memberikan nilai dengan dampak yang lebih besar, tidak hanya nilai ekonomi tetapi sosial. Penelitian sebagai landasan utama untuk mendekati masalah yang kompleks dalam bisnis dan masyarakat. Kami percaya pada hubungan yang saling memberi inspirasi dan pembelajaran silang untuk mencapai tujuan.<br><br>Saya selalu berusaha mengendalikan diri dalam mengungkapkan betapa bangganya saya menjadi anggota keluarga Kewirausahaan di Universitas Agung Podomoro. Ada begitu banyak masalah yang harus dipecahkan di Indonesia, kami membutuhkan Anda semua untuk berpartisipasi dan bergabung dengan keluarga besar kami dan memulai pertumbuhan Kewirausahaan yang berkelanjutan di Indonesia.</span></p><p><span class=\"tlid-translation translation\" lang=\"id\">\n<!--StartFragment--></span></p><p>E-mail :&nbsp;<a rel=\"nofollow\" target=\"_blank\" href=\"mailto:wisnu.dewobroto@podomorouniversity.ac.id\">wisnu.dewobroto@podomorouniversity.ac.id</a></p><p>Instagram : @WisnuDewobroto</p><p>Mobile Phone : +62813 1415 1660.</p><!--EndFragment-->\n\n<p><span class=\"tlid-translation translation\" lang=\"id\"><br></span><!--EndFragment-->\n\n</p>', NULL, '2020-03-25 23:38:29', '1019025');
INSERT INTO `prodi_texting` VALUES (89, 3, 2, NULL, 'vision', NULL, '\n<!--StartFragment--><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\" class=\"\">Menjadi program berbasis pengalaman belajar yang menghasilkan lulusan dengan semangat kewirausahaan, mampu menciptakan nilai-nilai untuk individu dan masyarakat, memiliki pemikiran analitis dan mampu secara nasional dan global.</span></span><!--EndFragment-->\n\n', NULL, '2020-03-25 23:39:55', '1019025');
INSERT INTO `prodi_texting` VALUES (90, 3, 2, NULL, 'about', NULL, '\n<!--StartFragment--><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\" class=\"\">Program kewirausahaan di Universitas Agung Podomoro mengembangkan pola pikir mahasiswa dalam menciptakan nilai-nilai dengan mengelola sumber daya secara inovatif dan kreatif.</span> <span title=\"\">Kurikulum dan metode pembelajaran ditingkatkan dengan kolaborasi dengan Babson Global, Inc. USA.</span> <span title=\"\">Kerangka kerja kurikulum berfokus pada pembelajaran pengalaman sehingga mahasiswa dapat memahami proses dalam penciptaan bisnis.</span> <span title=\"\">teori dikemas dalam pengalaman belajar di mana mahasiswa secara langsung melaksanakan proses penciptaan bisnis.</span> <span title=\"\">Melalui kurikulum kewirausahaan, para lulusan dipersiapkan untuk dapat menghadapi dunia industri baik secara nasional maupun internasional.</span></span><!--EndFragment-->\n\n', NULL, '2020-03-25 23:43:53', '1019025');
INSERT INTO `prodi_texting` VALUES (91, 3, 2, NULL, 'excellence', NULL, '\n<!--StartFragment--><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\" class=\"\">Untuk mendukung proses pembelajaran melalui pengalaman, Pusat Kepemimpinan Wirausaha Universitas Podomoro yang dikenal sebagai PUCEL dapat diakses oleh Mahasiswa Kewirausahaan dan alumni untuk memberikan program inovatif kepada mahasiswa untuk membantu mengembangkan keterampilan dan pola pikir kewirausahaan mereka.</span> <span title=\"\">Tujuan dari sistem pendukung ini adalah untuk meluncurkan dan menumbuhkan usaha dan membangkitkan semangat kewirausahaan mereka.</span> <span title=\"\">PUCEL muncul sebagai unggulan untuk kegiatan wirausaha di Indonesia yang menyelenggarakan program akademik dan mengelola kegiatan ko-kurikuler siswa yang mendukung penciptaan Pengusaha dari Semua Jenis di Indonesia.</span> <span title=\"\">Melalui PUCEL, para mahasiswa diharapkan untuk menjadi pemain aktif dalam Komunitas Kewirausahaan Indonesia yang mendukung dan memberdayakan para pemimpin yang beragam dan inovatif sambil membangun koneksi peer-to-peer yang berharga di antara para pemimpin bisnis yang berpengaruh, bertindak sebagai inkubator dan kekayaan intelektual.</span></span><!--EndFragment-->\n\n', NULL, '2020-03-25 23:45:45', '1019025');
INSERT INTO `prodi_texting` VALUES (92, 3, 2, NULL, 'graduate', NULL, '\n<!--StartFragment--><div class=\"text-wrap tlid-copy-target\"><div class=\"result-shield-container tlid-copy-target\" tabindex=\"0\"><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\" class=\"\">\n<!--StartFragment--><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\" class=\"\">Alumni </span></span><!--EndFragment-->Program Studi Kewirausahaan Universitas Podomoro mewakili \n<!--StartFragment--><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\" class=\"\">Semua</span></span><!--EndFragment-->\n\nKewirausahaan di Indonesia dan di seluruh dunia.</span><br><br><span title=\"\">Mereka adalah pemimpin masa depan dari perusahaan nasional dan internasional sebagai Pengusaha atau Karyawan</span>.<br><br><span title=\"\">Dari hari pertama siswa hingga hari terakhir di Universitas Podomoro, kami memberikan pengalaman mendalam untuk menemukan keinginan seseorang dan kemudian memposisikan setiap mahasiswa untuk sukses dalam mengejarnya.</span> <!--StartFragment--><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\" class=\"alt-edited\">Mereka mencapai ini melalui kemitraan pribadi dan hubungan yang kuat dengan fakultas kami, pemimpin industri, dan mahasiswa.</span></span><!--EndFragment-->\n\n</span><span class=\"tlid-translation-gender-indicator translation-gender-indicator\"></span></div></div><!--EndFragment-->\n\n', NULL, '2020-03-26 00:07:18', '1019025');
INSERT INTO `prodi_texting` VALUES (93, 3, 2, NULL, 'career', NULL, '<ul><li>\n<!--StartFragment--><span class=\"tlid-translation translation\" lang=\"id\">Pengusaha: seorang pemecah masalah, seseorang yang mengatur dan mengelola perusahaan apa pun, terutama bisnis, biasanya dengan inisiatif dan risiko yang cukup besar</span></li><li><span class=\"tlid-translation translation\" lang=\"id\">Intrapreneur : seorang karyawan yang bertugas mengembangkan ide atau proyek inovatif dalam suatu perusahaan</span></li><li><span class=\"tlid-translation translation\" lang=\"id\">Pengusaha Sosial : orang yang mendirikan perusahaan dengan tujuan menyelesaikan masalah sosial atau melakukan perubahan sosial</span></li><li><span class=\"tlid-translation translation\" lang=\"id\">Investor : setiap orang atau entitas lain (seperti perusahaan atau reksa dana) yang melakukan modal dengan harapan menerima pengembalian keuangan. Investor dapat menganalisis peluang dari berbagai sudut, dan umumnya lebih suka meminimalkan risiko sambil memaksimalkan pengembalian.</span></li><li><span class=\"tlid-translation translation\" lang=\"id\">Konsultan Bisnis : seorang profesional yang memberikan saran profesional atau ahli di bidang tertentu seperti keamanan (elektronik atau fisik), manajemen, akuntansi, hukum, sumber daya manusia, pemasaran (dan hubungan masyarakat), keuangan, teknik, sains atau yang lainnya</span></li><li><span class=\"tlid-translation translation\" lang=\"id\">Pelatihan Bisnis : Pelatih bisnis akan membantu dan membimbing pemilik bisnis dalam menjalankan bisnis dengan membantu mereka memperjelas visi bisnis mereka sehingga sesuai dengan tujuan bisnis mereka. Pelatihan bisnis adalah proses yang digunakan untuk mengambil bisnis dari tempat yang sekarang menjadi tempat yang diinginkan oleh pemilik bisnis.</span></li><li><span class=\"tlid-translation translation\" lang=\"id\">Pelatih : adalah seorang pendidik atau instruktur yang bekerja di lingkungan bisnis dan menyampaikan pengetahuan atau keterampilan kepada sekelompok karyawan.</span></li><li><span class=\"tlid-translation translation\" lang=\"id\">Politisi : adalah orang yang aktif dalam politik partai, atau orang yang memegang atau mencari jabatan di pemerintahan. Politisi mengusulkan, mendukung, dan membuat undang-undang atau kebijakan yang mengatur tanah dan, rakyatnya.</span><!--EndFragment-->\n\n</li></ul>', NULL, '2020-03-25 23:58:03', '1019025');
INSERT INTO `prodi_texting` VALUES (94, 3, 2, NULL, 'mission', NULL, '\n<!--StartFragment--><div class=\"text-wrap tlid-copy-target\"><ol><li><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\" class=\"\">Mengembangkan pendidikan kewirausahaan berdasarkan pengalaman belajar yang membangun pengetahuan, keterampilan dan karakter kewirausahaan</span></span></li><li><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\" class=\"\"></span><span title=\"\" class=\"\">Berkontribusi untuk penelitian, pengembangan dan penyebaran ilmu kewirausahaan, dan mengembangkan inovasi yang memberi manfaat bagi dunia kewirausahaan.</span></span></li><li><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\" class=\"\"></span><span title=\"\">Berkontribusi dalam memecahkan masalah sosial di Indonesia melalui kegiatan yang berorientasi kewirausahaan.</span></span><span class=\"tlid-translation-gender-indicator translation-gender-indicator\"></span></li></ol></div><!--EndFragment-->\n\n', NULL, '2020-03-26 00:00:26', '1019025');
