tStyles>\n</xml><![endif]-->\n\n<!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin-top:0in;\n	mso-para-margin-right:0in;\n	mso-para-margin-bottom:8.0pt;\n	mso-para-margin-left:0in;\n	line-height:107%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;\n	mso-ansi-language:EN-US;\n	mso-fareast-language:EN-US;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n<p class=\"MsoNormal\"><span lang=\"EN-US\">Selamat datang\ndi website Program Studi Akuntansi<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\"><span lang=\"EN-US\">Tidak bisa\ndipungkiri bahwa teknologi telah membawa banyak perubahan (disrupsi) dalam\ndunia industri. Teknologi menjadi <i>enabler\n</i>yang memungkinkan industri mencapai limit yang sebelumnya sulit dilakukan\ndan membuka banyak peluang bagi <i>startup </i>untuk\ntampil menantang industri yang telah mapan. Perkembangan ini juga menuntut\nadanya SDM yang siap teknologi, salah satunya adalah akuntan.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\"><span lang=\"EN-US\">Program Studi Akuntansi\nUniversitas Agung Podomoro merupakan salah satu program studi di Universitas\nAgung Podomoro yang mengedepankan pendidikan berbasis <i>entrepreneurial </i>dan erat dengan industri masa depan, serta didukung\noleh Agung Podomoro Group yang memiliki lebih dari 100 proyek properti<i>. </i>Kurikulum yang dijalankan bertujuan menyiapkan\nmahasiswa menyambut industri 4.0 masa depan dan siap menopang perkembangan\ndunia <i>startup</i>, terutama dalam aspek\nkeuangan. Program Studi Akuntansi Universitas Agung Podomoro membimbing\nmahasiswa untuk kuat secara fundamental ilmu dan secara aplikatif dapat\nmemanfaatkan teknologi bidang akuntansi dan keuangan dalam pekerjaannya kelak. <o:p></o:p></span></p>\n\n<p class=\"MsoNormal\"><span lang=\"EN-US\">Mendukung hal\ntersebut, Program Studi Akuntansi memiliki tenaga pengajar praktisi, akademisi dan\npengusaha yang siap membimbing mahasiswa menyiapkan diri untuk industri masa\ndepan. Program studi Akuntansi juga menyiapkan laboratorium yang mampu\nmendukung pengembangan mahasiswa, terutama dalam bidang : akuntansi perusahaan,\naudit, perpajakan, saham, keuangan dan penciptaan startup. Secara khusus Universitas\nAgung Podomoro juga menyediakan fasilitas inkubator untuk menyiapkan lulusan\nmenjadi penopang <i>startup </i>dalam bidang\nkeuangan.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\"><span lang=\"EN-US\">Kami sangat berupaya\nagar Program Studi Akuntansi Universitas Agung Podomoro menjadi wadah\npenciptaan SDM yang siap untuk industri masa depan dan siap menopang\nperkembangan startup Indonesia dan Global.<o:p></o:p></span></p>\n\n<p class=\"MsoNormal\"><b><span lang=\"EN-US\" style=\"\">Sri Handayani, S.E., M. Ak.<u><o:p></o:p></u></span></b></p>\n\n<p class=\"MsoNormal\"><span lang=\"EN-US\">Ketua Program\nStudi Akuntansi Universitas Agung Podomoro<o:p></o:p></span></p>\n\n<!--EndFragment-->', NULL, '2020-09-14 14:09:57', '1015076');
INSERT INTO `prodi_texting` VALUES (96, 4, 1, NULL, 'welcoming', NULL, '<!--StartFragment--><p class=\"MsoNormal\"><span lang=\"EN-US\"><span>Welcome to the\nAccounting Study Program website,<o:p></o:p></span></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">It is inevitable\nthat technology has brought many changes (disruption) in the industry.\nTechnology becomes an enabler that enables industries to reach the limits that previously\nalmost impossible. Technology also opens up many opportunities for startups to\nappear and challenge the established industries. Furthermore, technology\nproliferation also requires the existence of technology-ready human resources,\none of those is technology-ready accountant. The Accounting Study Program -&nbsp; Agung Podomoro University is one of the study programs in Agung Podomoro University\nthat promotes entrepreneurial-based education, connected to the industry, and supported\nby the Agung Podomoro Group which has more than 100 property projects. The\ncurriculum is aimed at preparing students to face the industry 4.0 and ready to\nsupport the proliferation of startup businesses, especially in the financial\naspect. The&nbsp;</span>&nbsp;Accounting Study Program - Agung Podomoro University guides students\nto be fundamentally strong in knowledge and be able to apply technology in the\nfields of accounting and finance.</p><p class=\"MsoNormal\"><span lang=\"EN-US\">Accounting\nStudy Program has many lecturers who are professionals, academics and\nentrepreneurs who are ready to guide students to prepare themselves for future\nindustries. The Accounting study program also prepares laboratories that are\ncapable of supporting student development, especially in the areas of:\ncorporate accounting, auditing, taxation, stocks, finance and startup creation.\nIn particular, Agung Podomoro University also provides incubator facilities to\nprepare graduates to support startups in the financial sector. <o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">We are working\nhard to make the&nbsp;</span>&nbsp;Accounting Study Program - Agung Podomoro University a place for\nincubating human resources that is ready for the industry of the future and\nready to support the development of startups businesses in Indonesian and\nGlobal. We invite you to join and grow together.</p><p class=\"MsoNormal\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\">Regards,<o:p></o:p></span></p><p class=\"MsoNormal\"><span lang=\"EN-US\"><b>Sri Handayani, S.E., M. Ak.</b><o:p></o:p></span></p><p class=\"MsoNormal\">\n\n\n\n\n<!--[if gte mso 9]><xml>\n <o:OfficeDocumentSettings>\n  <o:AllowPNG></o:AllowPNG>\n </o:OfficeDocumentSettings>\n</xml><![endif]-->\n\n\n<!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves></w:TrackMoves>\n  <w:TrackFormatting></w:TrackFormatting>\n  <w:PunctuationKerning></w:PunctuationKerning>\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\n  <w:LidThemeOther>IN</w:LidThemeOther>\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables></w:BreakWrappedTables>\n   <w:SnapToGridInCell></w:SnapToGridInCell>\n   <w:WrapTextWithPunct></w:WrapTextWithPunct>\n   <w:UseAsianBreakRules></w:UseAsianBreakRules>\n   <w:DontGrowAutofit></w:DontGrowAutofit>\n   <w:SplitPgBreakAndParaMark></w:SplitPgBreakAndParaMark>\n   <w:EnableOpenTypeKerning></w:EnableOpenTypeKerning>\n   <w:DontFlipMirrorIndents></w:DontFlipMirrorIndents>\n   <w:OverrideTableStyleHps></w:OverrideTableStyleHps>\n  </w:Compatibility>\n  <m:mathPr>\n   <m:mathFont m:val=\"Cambria Math\"></m:mathFont>\n   <m:brkBin m:v