yles>\n</xml><![endif]-->\n\n<!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0in 5.4pt 0in 5.4pt;\n	mso-para-margin-top:0in;\n	mso-para-margin-right:0in;\n	mso-para-margin-bottom:8.0pt;\n	mso-para-margin-left:0in;\n	line-height:107%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",sans-serif;\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;\n	mso-fareast-language:EN-US;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n<p>Program\nStudi Akuntansi - Universitas Agung Podomoro memberikan pendidikan komprehensif\ndi bidang akuntansi manajemen, audit, perpajakan, dan akuntansi untuk <span lang=\"EN-US\">bisnis <i>startup&nbsp;</i></span>dengan berbasiskan jiwa\nkewirausahaan. Setiap mata <span lang=\"EN-US\">kuliah</span> diajarkan berdasarkan pendekatan <i>experiential learning</i> yang berfokus pada\nketerampilan <span lang=\"EN-US\">analisis</span> kasus yang selalu <i><span lang=\"EN-US\">up to date</span></i>. Proses pembelajaran dilakukan dalam pendekatan berbasis praktik\ndan didukung oleh laboratorium organik, inkubator serta dilakukan dalam <span lang=\"EN-US\">format </span>praktik <span lang=\"EN-US\">nyata </span>di industri. <span lang=\"EN-US\">Mahasiswa</span> diminta\nuntuk melakukan magang di industri atau kantor akuntan publik.</p><p><o:p></o:p></p>\n\n<!--EndFragment--><!--EndFragment-->', NULL, '2020-04-02 11:18:45', '1116066');
