></w:LsdException>\n </w:LatentStyles>\n</xml><![endif]-->\n\n<!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\n	mso-para-margin-top:0cm;\n	mso-para-margin-right:0cm;\n	mso-para-margin-bottom:10.0pt;\n	mso-para-margin-left:0cm;\n	line-height:115%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",\"sans-serif\";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n\n\n\n\n\n\n\n\n<ol><li>Meningkatkan pendidikan\nakuntansi berstandar internasional melalui pendekatan pendidikan lintas\ndisiplin, komprehensif dan diperkuat fondasinya dengan pendidikan <i>“liberal arts”</i>.<o:p></o:p></li><li>Mendidik para mahasiswa agar\nmemiliki jiwa <i>entrepreneur</i>, mampu\nmenerapkan keahliannya dalam berbagai bidang usaha dan organisasi dan berdaya\nsaing global.<o:p></o:p></li><li>Menerapkan metode pendidikan\nyang interaktif.<o:p></o:p></li><li>Mendidik mahasiswa agar mampu\nberkomunikasi, berpikir kritis, beretika dan mampu mengambil keputusan.<o:p></o:p></li><li>Meningkatkan kualitas penelitian\nuntuk pengembangan ilmu dan teknologi pada bidang akuntansi.</li><li>Mendorong kontribusi\nyang lebih baik bagi masyarakat dan profesi sebagai pengabdian kepada\nmasyarakat guna peningkatan kesejahteraan.</li></ol><!--EndFragment-->', NULL, '2020-03-31 13:20:08', '1015076');
