INSERT INTO `prodi_texting` VALUES (103, 4, 2, NULL, 'excellence', NULL, '<p><!--StartFragment-->Perkuliahan di Program Studi Akuntansi Universitas Agung Podomoro memiliki keunggulan-keunggulan yang menjadikannya unik yang akan menunjang proses belajar mengajar di bidang akuntansi, antara lain:</p><p><!--EndFragment--></p><p><!--EndFragment--></p><ol><li><!--StartFragment-->Bekerja dengan Babson Global Inc, dari Babson College USA, sebuah perguruan tinggi terbaik di AS dalam bidang kewirausahaan. Kerjasama ini menghasilkan suatu pembekalan keilmuan dan praktik dalam membentuk karakter dan jiwa kewirausahaan mahasiswa.</li><li>Memiliki tenaga pengajar yang ahli dalam berbagai disiplin ilmu akuntansi.</li><li>Memiliki program magang pada industri maupun Kantor Akuntan Publik (KAP) yang dapat mengasah kemampuan serta mengaplikasikan ilmu yang diperoleh mahasiswa.</li><li>Fasilitas kampus yang memadai terdiri dari ruang kelas dan laboratorium yang membuat mahasiswa nyaman selama mengikuti proses perkuliahan.</li><li>Bekerjasama dengan pelaku industri, pengembang aplikasi di bidang akuntansi, serta bidang lainnya yang mampu menunjang proses pembelajaran mahasiswa.<!--EndFragment--><!--EndFragment--></li></ol>', NULL, '2020-03-31 14:09:21', '1015076');
INSERT INTO `prodi_texting` VALUES (104, 4, 2, NULL, 'career', NULL, '<p>Lulusan Program Studi Akuntansi Universitas Agung Podomoro memiliki kesempatan untuk berkarir pada bidang pekerjaan yang berkaitan erat dengan bidang akuntansi. Bidang tersebut antara lain sebagai berikut:</p><ol><li>Auditor Eksternal</li><li>Auditor Internal</li><li>Akuntan Perpajakan</li><li>Akuntan Perusahaan&nbsp;</li><li>\n\n\n\n\n<!--[if gte mso 9]><xml>\n <o:OfficeDocumentSettings>\n  <o:AllowPNG></o:AllowPNG>\n </o:OfficeDocumentSettings>\n</xml><![endif]-->\n\n\n<!--[if gte mso 9]><xml>\n <w:WordDocument>\n  <w:View>Normal</w:View>\n  <w:Zoom>0</w:Zoom>\n  <w:TrackMoves></w:TrackMoves>\n  <w:TrackFormatting></w:TrackFormatting>\n  <w:PunctuationKerning></w:PunctuationKerning>\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\n  <w:LidThemeOther>EN-US</w:LidThemeOther>\n  <w:LidThemeAsian>JA</w:LidThemeAsian>\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\n  <w:Compatibility>\n   <w:BreakWrappedTables></w:BreakWrappedTables>\n   <w:SnapToGridInCell></w:SnapToGridInCell>\n   <w:WrapTextWithPunct></w:WrapTextWithPunct>\n   <w:UseAsianBreakRules></w:UseAsianBreakRules>\n   <w:DontGrowAutofit></w:DontGrowAutofit>\n   <w:SplitPgBreakAndParaMark></w:SplitPgBreakAndParaMark>\n   <w:EnableOpenTypeKerning></w:EnableOpenTypeKerning>\n   <w:DontFlipMirrorIndents></w:DontFlipMirrorIndents>\n   <w:OverrideTableStyleHps></w:OverrideTableStyleHps>\n   <w:UseFELayout></w:UseFELayout>\n  </w:Compatibility>\n  <w:DoNotOptimizeForBrowser></w:DoNotOptimizeForBrowser>\n  <m:mathPr>\n   <m:mathFont m:val=\"Cambria Math\"></m:mathFont>\n   <m:brkBin m:val=\"before\"></m:brkBin>\n   <m:brkBinSub m:val=\"&#45;-\"></m:brkBinSub>\n   <m:smallFrac m:val=\"off\"></m:smallFrac>\n   <m:d