INSERT INTO `prodi_texting` VALUES (105, 4, 2, NULL, 'testimonials', NULL, 'Belajar di Universitas Agung Podomoro mengajari saya berbagai hal dengan bimbingan dosen yang berpengalaman dibidangnya, saya diajari tidak hanya teori tapi juga praktik untuk menghadapi dunia kerja nanti.', NULL, '2020-03-31 14:42:06', '1015076');
INSERT INTO `prodi_texting` VALUES (106, 4, 1, NULL, 'testimonials', NULL, 'Studiying at Podomoro University taught me various things with the guidance of lecturers who are experienced in their fields, I was taught not only the theory but the practice to be ready to face the world of work later.', NULL, '2020-03-31 14:44:58', '1015076');
INSERT INTO `prodi_texting` VALUES (107, 4, 1, NULL, 'testimonials', NULL, '<!--StartFragment-->At Podomoro University I’m not only learned about Accounting, but also learned how to be a great entrepreneur from “Thinking and Acting like an Entrepreneurial Leader (TAEL)” class. I was taught how to see from perspective of an entrepreneur. For me, TAEL class very useful for my future.<!--EndFragment-->', NULL, '2020-03-31 14:53:14', '1015076');
