INSERT INTO `prodi_texting` VALUES (109, 4, 1, NULL, 'vision', NULL, 'To nurture accounting graduates who are reliable, able to compete globally and have an entrepreneurial spirit<!--EndFragment-->', NULL, '2020-04-02 10:54:41', '1116066');
INSERT INTO `prodi_texting` VALUES (110, 4, 1, NULL, 'mission', NULL, '<ol><li><span>Improving\ninternational standard - accounting education through a comprehensive\ncross-disciplinary approach and strengthened by \"liberal arts\"\neducation</span></li><li>Educating\nstudents to have entrepreneurial spirit, be able to apply the expertise in\nvarious fields of business and organization and be globally competitive.</li><li>Conducting\ninteractive educational methods.</li><li>Educating\nstudents to be able to communicate, think critically, be ethical and be able to\nmake decisions.</li><li>Improving the quality of\nresearch for the development of science and technology in the field of\naccounting.</li><li>Contributing\nto the society and the profession as a service to the community in order to\nimprove welfare.</li></ol><!--EndFragment--><!--StartFragment--><!--EndFragment--><!--StartFragment--><!--EndFragment--><!--StartFragment--><!--EndFragment--><!--EndFragment--><!--StartFragment--><!--EndFragment-->', NULL, '2020-04-02 15:19:37', '1015076');
