entStyles>\n</xml><![endif]-->\n\n<!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\n	mso-para-margin-top:0cm;\n	mso-para-margin-right:0cm;\n	mso-para-margin-bottom:8.0pt;\n	mso-para-margin-left:0cm;\n	line-height:107%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",\"sans-serif\";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n<p class=\"MsoNormal\">Lectures in the Podomoro University Accounting Study\nProgram have advantages that make it unique that will support the teaching and\nlearning process in accounting, including:<o:p></o:p></p>\n\n<ol><li>Works with Babson Global Inc., from Babson\nCollege USA, the best college in the US in the field of entrepreneurship. This\ncollaboration resulted in a scientific briefing and practice in shaping the\ncharacter and entrepreneurial spirit of students.</li><li>Having teaching staff who are experts in various\naccounting disciplines.</li><li>Have an internship program in the industry and\nthe Public Accounting Firm that can hone skills and apply the knowledge gained\nby students.</li><li>Adequate campus facilities consist of classrooms\nand laboratories that make students comfortable during the lecture process.</li><li>Collaborate with industry players, application\ndevelopers in accounting, and other fields that are able to support the\nlearning process of students.</li></ol>\n\n<!--EndFragment-->\n\n<!--EndFragment-->', NULL, '2020-04-02 15:17:45', '1015076');
