tStyles>\n</xml><![endif]-->\n\n<!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\n	mso-para-margin-top:0cm;\n	mso-para-margin-right:0cm;\n	mso-para-margin-bottom:8.0pt;\n	mso-para-margin-left:0cm;\n	line-height:107%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",\"sans-serif\";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n<p class=\"MsoNormal\">Graduates of the Podomoro University Accounting Study\nProgram are expected to have expertise in the following fields:</p><ol><li><i><b>External Auditor</b></i>. The Accounting Study Program (1) prepares\ngraduates to be able to conduct audits or audits of financial statements from\ninstitutions / companies, and (2) prepares graduates to be able to provide\nprofessional expertise in conducting assessments or attestation independently\nof financial information.</li><li><b><i>Internal Auditor</i></b>. The Accounting Study Program (1) prepares\ngraduates to have professional abilities to internally assess or attest\nfinancial information and the efficiency and effectiveness of institutions /\ncompanies, and (2) prepares graduates to be able to consider organizational\ncharacteristics and business risks.</li><li><b><i>Taxation Accountant</i></b>. The Accounting Study Program (1)\nprepares graduates to be able to make and fill various institutional / company\ntax reporting formats and startups, and (2) prepares graduates to have tax\naccounting skills so that they can make good and correct taxation financial\ndecisions.</li><li><b><i>Company Accountant</i></b>. Accounting Study Program (1) prepares\ngraduates to be able to present institutional / company financial statements\ncorrectly and in accordance with applicable regulations (SAK), and (2) prepares\ngraduates to be able to analyze company financial data, budget preparation,\nbusiness risk assessment, system development information in an institution /\ncompany properly and correctly for the purposes of management decision making.</li><li><i><b>Chief Financial Officer at Startup</b></i>. Accounting Study Program\n(1) prepares graduates to be able to manage finances at startup, (2) prepares\ngraduates to be able to plan financial startups correctly for investment needs,\n(3) prepares graduates to be able to present startup financial reports\ncorrectly and in accordance with applicable regulations (SAK EMKM and ETAP),\nand (4) Preparing graduates to be able to make plans to obtain working capital\nfunding, use or allocate funds, and manage their assets to achieve the main\nobjectives of startup.</li><li><b><i>Junior Financial Analyst and Consultant</i></b>. Accounting Study\nProgram (1) prepares graduates to be able to analyze and interpret financial\nperformance in order to recommend financial decisions of institutions /\ncompanies, and (2) prepare graduates to be able to conduct analyzes to assess\nbusiness continuity, stability, profitability of a business, sub-business or\nproject.</li></ol><p class=\"MsoNormal\"><o:p></o:p></p>\n\n<!--EndFragment-->', NULL, '2020-04-02 15:14:02', '1015076');
