tyles>\n</xml><![endif]-->\n\n<!--[if gte mso 10]>\n<style>\n /* Style Definitions */\n table.MsoNormalTable\n	{mso-style-name:\"Table Normal\";\n	mso-tstyle-rowband-size:0;\n	mso-tstyle-colband-size:0;\n	mso-style-noshow:yes;\n	mso-style-priority:99;\n	mso-style-parent:\"\";\n	mso-padding-alt:0cm 5.4pt 0cm 5.4pt;\n	mso-para-margin-top:0cm;\n	mso-para-margin-right:0cm;\n	mso-para-margin-bottom:8.0pt;\n	mso-para-margin-left:0cm;\n	line-height:107%;\n	mso-pagination:widow-orphan;\n	font-size:11.0pt;\n	font-family:\"Calibri\",\"sans-serif\";\n	mso-ascii-font-family:Calibri;\n	mso-ascii-theme-font:minor-latin;\n	mso-hansi-font-family:Calibri;\n	mso-hansi-theme-font:minor-latin;\n	mso-bidi-font-family:\"Times New Roman\";\n	mso-bidi-theme-font:minor-bidi;}\n</style>\n<![endif]-->\n\n\n\n<!--StartFragment-->\n\n<p class=\"MsoNormal\">Graduates of the Accounting Studies Program at Podomoro\nUniversity have the opportunity to have a career in a field of work that is\nclosely related to the field of accounting. These fields include the following:</p><ol><li>External Auditor</li><li>Internal Auditor</li><li>Taxation Accountant</li><li>Company Accountant</li><li>Chief Financial Officer at Startup</li><li>Junior Financial Analyst and Consultant</li></ol><p class=\"MsoNormal\"><o:p></o:p></p>\n\n<!--EndFragment-->', NULL, '2020-04-02 15:17:21', '1015076');
INSERT INTO `prodi_texting` VALUES (115, 5, 1, NULL, 'excellence', NULL, '<p>Learning in Hotel Business Program - Podomoro University meaning that you are being prepared to be the Citizen of the World. The program is designed to equip the students not only with updated knowledge, and skills, but also to shape international mindset as well as attitude. The selections of subjects are modern and up to date, matches with the requirements of the industry.&nbsp;</p><p>Students will be exposed to top-notch kind of networking since the early stage of their learning program. Through the internship program students also will be introduced to the industry not only in their home country but also in many countries all around the globe.</p>', NULL, '2020-05-11 18:03:28', '3118048');
INSERT INTO `prodi_texting` VALUES (116, 5, 2, NULL, 'excellence', NULL, '<div>Belajar di Program Strudi Bisnis Perhotelan di Universitas Agung Podomoro artinya Anda sedang dipersiapkan untuk menjadi \"<i>Citizen of the world\"</i>. Program ini dirancang untuk membekali para siswa tidak hanya dengan pengetahuan, dan keterampilan yang terbaru, tetapi juga untuk membentuk pola pikir dan <i>attitude</i>&nbsp;internasional. Pilihan mata kuliah yang tersaji modern dan kekinian, cocok dengan apa yang dibutuhkan di industri.</div><div><br></div><div>Siswa akan dihadapkan pada <i>networking </i>terbaik sejak tahap awal program pembelajaran mereka. Melalui program magang siswa juga akan diperkenalkan ke industri tidak hanya di negara asal mereka tetapi juga di banyak negara di seluruh dunia.</div>', NULL, '2020-05-11 18:10:31', '3118048');
INSERT INTO `prodi_texting` VALUES (117, 5, 1, NULL, 'graduate', NULL, '<p>The graduates of Hotel Business Programs are future leaders in the hospitality industry in various fields such as hotels and other service-based industries with specialties in below divisions:</p><p>1. Front Office</p><p>2. Culinary</p><p>3. Food and Beverages Management</p><p>4. Service Management</p><p>5. Human Resources</p><p>6. Revenue Management, Sales. and Marketing</p><p>7. Communications &amp; Events</p>', NULL, '2020-05-11 21:47:40', '3118048');
INSERT INTO `prodi_texting` VALUES (118, 5, 2, NULL, 'whychoose', NULL, '<div>Program Studi Bisnis Perhotelan di Universitas &nbsp;Agung Podomoro tidak hanya menawarkan pendidikan formal, tetapi pengalaman hidup yang tak terlupakan, kedekatan kami dengan industri memberi mahasiswa kami kesempatan untuk mengeksplorasi semua kemungkinan dan membangun jaringan mereka saat mereka belajar.</div><div><br></div><div>Kurikulum dirancang sedemikian rupa sehingga siswa dapat memperoleh pengetahuan yang dibutuhkan untuk menjadi seorang pengusaha perhotelan dengan semangat kewirausahaan, termasuk program magang terintegrasi dalam kurikulum yang memperkaya pengalaman siswa dan tidak hanya mempertajam keterampilan tetapi juga menambah wawasan internasional.</div><div><br></div><div>Hal lain adalah lingkungan belajar yang menyenangkan melalui kelas simulasi, kegiatan pengayaan, dosen tamu berskala internasional, dan partisipasi dalam berbagai acara yang membuat pengalaman belajar di Podomoro University lebih menyenangkan.</div><div><br></div><div>Fasilitas canggih disediakan untuk siswa, sehingga siswa lebih siap memasuki industri dengan skala bintang lima dan mewah.</div><div><br></div><div>Belajar di Program Bisnis Hotel adalah benar-benar pengalaman yang menyenangkan!</div><br class=\"Apple-interchange-newline\">', NULL, '2020-05-11 22:12:16', '3118048');
INSERT INTO `prodi_texting` VALUES (130, 2, 1, NULL, 'whychoose', NULL, '<p>D4 Study Program in Construction Management and Engineering, Agung Podomoro University (D4 CEM Study Program) is a Study Program that is ready to produce competent construction workers to support national development targets.</p><p>Studying in this study program can provide its own challenges. Students who study in D4 CEM Study Progran are always challenged to develop their competencies in the field of construction with collaborative learning methods base on construction projects. Interaction between students and lectures will make the learning process fun and achieve its goals effectively.</p>', NULL, '2020-06-16 14:35:23', '1019027');
INSERT INTO `prodi_texting` VALUES (134, 2, 1, NULL, 'about', NULL, '\n<!--StartFragment--><span class=\"tlid-translation translation\" tabindex=\"-1\" lang=\"en\"><span title=\"\" class=\"\">D4 Study Program in Management and Construction Engineering at Agung Podomoro University offers an alternative to completing a 4 year study.</span> <span title=\"\" class=\"\">This study program can be completed by 2 ways of preparing a Final Project, namely by preparing a thesis or working on a final project.</span></span><!--EndFragment-->\n\n', NULL, '2020-06-22 08:29:26', '1019027');
INSERT INTO `prodi_texting` VALUES (135, 2, 1, NULL, 'excellence', NULL, '\n<!--StartFragment--><span class=\"tlid-translation translation\" lang=\"en\">The lecturer in the Construction Management and Engineering Study Program consists of academics as well as experienced and competent practitioners in the world of construction services. As practitioners they can share their field experiences from various types of construction projects to be used as case studies. While as academics, lecturers have contributed to the world of science by regularly publishing the results of their research which also involves students.<br><br><br>With the collaboration program with professional associations engaged in construction services, such as the Indonesian Quantity Surveyor Association (IQSI) and the Construction Services Center of the Ministry of Public Works and Public Housing, MRK graduates will be equipped with competency certificates that accompany graduation certificates, this certificate will be a value added for MRK graduates in the construction industry. D4 Study Program in Construction Management and Engineering at Agung Podomoro University is a Study Program that is ready to produce competent construction workers to support national development targets.</span><!--EndFragment-->\n\n', NULL, '2020-06-22 08:29:58', '1019027');
INSERT INTO `prodi_texting` VALUES (136, 2, 1, NULL, 'graduate', NULL, '\n<!--StartFragment--><div class=\"text-wrap tlid-copy-target\"><div class=\"result-shield-container tlid-copy-target\" tabindex=\"0\"><span class=\"tlid-translation translation\" lang=\"en\"><span title=\"\" class=\"\">Construction Planner:</span><br><br><span title=\"\" class=\"\">Construction planners are service providers of individuals or business entities that are declared experts and professionals in the field of construction service planners.</span><br><br><span title=\"\">Contractor:</span><br><br><span title=\"\">Construction implementer is a service provider of individuals or business entities that are declared professional in the field of construction services implementation.</span><br><br><span title=\"\">Construction Supervisor:</span><br><br><span title=\"\">Construction Supervisor is a service provider of individuals or business entities that are declared experts and professionals in the field of construction services supervision.</span><br><br><span title=\"\">Academics:</span><br><br><span title=\"\">Academics are professional teaching staff</span></span><span class=\"tlid-translation-gender-indicator translation-gender-indicator\"></span></div></div><!--EndFragment-->\n\n', NULL, '2020-06-22 08:30:35', '1019027');
INSERT INTO `prodi_texting` VALUES (137, 2, 2, NULL, 'career', NULL, '\n<!--StartFragment--><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\" class=\"\">1. Surveyor Kuantitas Junior</span><br><br><span title=\"\">2. Insinyur Proyek</span><br><br><span title=\"\">3. Insinyur Lapangan</span><br><br><span title=\"\" class=\"\">4. Kontrol Kualitas Proyek</span><br><br><span title=\"\" class=\"\">5. Penjadwal Proyek</span><br><br><span title=\"\" class=\"\">6. Pemeliharaan Bangunan</span><br><br><span title=\"\" class=\"\">7. Administrator Kontrak Junior</span><br><br><span title=\"\">8. Staf Laboratorium</span></span><!--EndFragment-->\n\n', NULL, '2020-06-22 08:31:36', '1019027');
INSERT INTO `prodi_texting` VALUES (148, 2, 2, NULL, 'testimonials', NULL, '\n<!--StartFragment--><span class=\"tlid-translation translation\" tabindex=\"-1\" lang=\"id\"><span title=\"\" class=\"\">Selain saya belajar tentang konstruksi, saya juga tertarik dengan Pola pikir Wirausaha untuk berpikir kreatif dan inovatif</span></span><!--EndFragment-->\n\n', NULL, '2020-06-29 16:46:13', '1019027');
INSERT INTO `prodi_texting` VALUES (149, 2, 2, NULL, 'testimonials', NULL, '\n<!--StartFragment--><span class=\"tlid-translation translation\" lang=\"id\"><span title=\"\">Universitas Podomoro telah membuka peluang saya untuk masuk langsung ke dunia konstruksi.</span> <span title=\"\" class=\"\">Berbagai program magang yang ditawarkan telah memberi saya lebih banyak pengalaman sebelum memasuki dunia kerja</span></span><!--EndFragment-->\n\n', NULL, '2020-06-29 16:46:45', '1019027');
